INSERT INTO `guides` VALUES (5,NULL,2,'Organisation de la mission en cours\r\n\r\nRles et responsabilits\r\n\r\nRsolution des conflits et escalation','Ongoing risk assessment organization\r\n\r\nRoles and responsibilities\r\n\r\nConflict resolution and escalation paths','Organisation der Risikobewertung\r\n\r\nRollen und Zustndigkeiten\r\n\r\nKonfliktlsung und Eskalationsverfahren','Organisatie van de lopende missie\r\n\r\nRollen en verantwoordelijkheden\r\n\r\nOplossing van de conflicten en escalatie',0,NULL,'2017-01-19 13:11:46',NULL,'1970-01-01 00:00:00'),(6,NULL,3,'Tendances sur les critres CID ?\nAttaques internes / externes ?\nErreurs utilisateurs ?\nMenaces plus probables ?\nMenaces  ne pas considrer ?','CIA criteria trends?\nInternal / external attacks?\nUser Errors?\nThe most likely Threats?\nThreats not to be considered? ','CIA-Kriterientrends?\nInterne/externe Attacken?\nBenutzerfehler?\nDie wahrscheinlichsten Bedrohungen?\nNicht zu bercksichtigende Bedrohungen? ','Tendensen op de CIB-criteria?\nInterne / externe aanvallen?\nGebruikersfouten?\nWaarschijnlijkere bedreigingen?\nNiet in aanmerking te nemen bedreigingen?',0,NULL,'2017-01-19 13:11:48',NULL,'1970-01-01 00:00:00'),(7,NULL,1,'Considrations gnrales : Raison pour lesquelles l\'analyse est ralise ? Gestion dun ISMS, prparation plan de continuit, gestion des incidents, aspects lgaux\r\n\r\nApproche de la gestion des risques : Itrations en cours, choix des ressources \r\n\r\nCritres de bases : \r\n  - Critres d\'valuation des risques : valeurs stratgiques processus ou informationnel, obligations lgales, rglementaires ou contractuelles\r\n  - Critres d\'impact : Consquences sur le business, l\'image, lgal, ...\r\n  - Critres d\'acceptation des risques : ROSI (Return On Security Investment), lois et rglements, traitements futurs du risque, stratgie de lentreprise\r\n\r\nCibles et limites : Activit, processus  couvrir, objectifs de lorganisation, limites et exclusion de lanalyse (gographique, logique), contraintes lgales, environnement socio-culturel, autres contraintes','General considerations: What is the purpose of the information security risk management ? ISMS Management, preparation of a business continuity plan or incident response plan , legal compliance.\r\n\r\nRisk management approach: ongoing iteration, provision of resources.\r\n\r\nBasic Criteria: \r\n- Risk evaluation criteria: The process strategic value or information, legal obligations, regulatory requirements or contractuals.\r\n- Impact criteria:  Consequences on business, image, legal, ...\r\n- Risk acceptance criteria : ROSI (Return On Security Investment), legal and regulatory aspects, future security risk management, company strategy.\r\n\r\nScope and boundaries: Activity, business processes, organization\'s objectives,  limits and exclusion of the analysis (geographical, logical ...), legal requirements, socio-cultural environment, other requirements.','Allgemeine berlegungen: Wozu dient das Informationssicherheits-Risikomanagement? ISMS-Verwaltung, Vorbereitung eines Geschftskontinuittsplans oder Vorfallreaktionsplans, Einhaltung gesetzlicher Vorschriften\r\n\r\nRisikomanagementansatz: kontinuierliche Iteration, Bereitstellen von Ressourcen\r\n\r\nGrundlegende Kriterien: \r\n- Risikobeurteilungskriterien: Prozessstrategische Werte oder Informationen, gesetzliche Verpflichtungen, aufsichtsrechtliche Anforderungen oder vertragliche Verpflichtungen\r\n- Auswirkungskriterien:  Folgen fr Geschft, Image, Rechtliches\r\n- Risikoakzeptanzkriterien: ROSI (Return On Security Investment), rechtliche und aufsichtsrechtliche Aspekte, zuknftiges Sicherheitsrisikomanagement, Unternehmensstrategie\r\n\r\nGeltungsbereich und Grenzen: Aktivitt, Geschftsprozesse, Ziele der Organisation, Analysebeschrnkungen und -ausschlsse (geografisch, logisch), gesetzliche Anforderungen, soziokulturelle Umgebung sowie andere Anforderungen\r\n','Algemene overwegingen: Reden(en) waarvoor de analyse wordt gemaakt? Beheer van ISMS, opmaak continuteitsplan, beheer van de incidenten, juridische aspecten\r\n\r\nAanpak van het risicobeheer: herhalingen bezig, keuze van de middelen\r\n\r\nBasiscriteria: \r\n  - risico-evaluatiecriteria: strategische informatie- of proceswaarden, wettelijke, reglementaire of contractuele verplichtingen\r\n  - effectcriteria: gevolgen voor de business, het imago, juridisch...\r\n  - Risicoaanvaardingscriteria: ROSI (Return On Security Investment), wetten en reglementen, toekomstige aanpak van het risico, strategie van de firma\r\n\r\nDoelen en grenzen: activiteit, te dekken proces, doelstellingen van de organisatie, beperkingen en uitsluiting van de analyse (geografisch, logisch), wettelijke verplichtingen, socioculturele omgeving, andere verplichtingen',1,NULL,'2017-01-19 13:11:49',NULL,'1970-01-01 00:00:00'),(8,NULL,4,'Actifs primaires slectionns ?\nCritres de scurit relevant ?\nActifs de support principaux ?\nParticularit de la modlisation ?','Identified primary assets?\nSecurity criteria?\nMain supporting assets?\nFeature of the modeling?','Identifizierte primre Werte?\nSicherheitskriterien?\nWichtigste untersttzende Werte?\nFunktion des Modellierung?','Geselecteerde primaire activa?\nRelevante veiligheidscriteria?\nVoornaamste ondersteuningsactiva?\nBijzonderheid van de modellering?',0,NULL,'2017-01-19 13:11:51',NULL,'1970-01-01 00:00:00');
