INSERT INTO `questions` VALUES (66,'Quelle est la raison d\'tre de votre structure ?','What is the purpose of your organization?','Was ist der Zweck Ihrer Organisation?','Wat is de bestaansreden van uw structuur?',1,1,0,NULL,'2017-01-19 12:07:50',NULL,NULL),(67,'Quelle est l\'volution de votre activit de dernires annes ?','What is the progression of your business in recent years?','Welchen Verlauf hat Ihr Unternehmen in den letzten Jahren geschftlich genommen?','Hoe is uw activiteit de afgelopen jaren gevolueerd?',2,1,0,NULL,'2017-01-19 12:07:51',NULL,NULL),(68,'Quelle est l\'volution du contexte externe (concurrence, volution march, lois, etc.) ?','What is the evolution of the external environment (competition, market evolution, laws, etc.)?','Wie haben sich die externen Kriterien verndert (Wettbewerb, Marktentwicklung, rechtliche Rahmenbedingungen usw.)?','Hoe is de externe context gevolueerd (concurrentie, markt, wetgevingenz.) ?',3,1,0,NULL,'2017-01-19 12:07:52',NULL,NULL),(69,'Quels pourraient tre les motifs d\'attaque contre votre structure ?','What might be the attack reasons on your structure?','Welche Angriffsflchen knnte Ihre Struktur bieten?','Wat zouden motieven kunnen zijn om uw structuur aan te vallen?',4,2,1,NULL,'2017-01-19 12:07:53',NULL,NULL),(70,'Quels sont vos processus mtiers les plus importants ?','What are your most important business processes?','Nennen Sie Ihre wichtigsten Geschftsprozesse:','Welke zijn uw belangrijkste vakprocessen?',5,1,0,NULL,'2017-01-19 12:07:58',NULL,NULL),(71,'Quel est l\'actif ayant le plus de valeur dans votre structure ?','What is the most valuable asset in your organization?','Nennen Sie die wichtigsten Vermgenswerte in Ihrer Organisation:','Welk actief heeft de hoogste waarde binnen uw structuur?',6,1,0,NULL,'2017-01-19 12:07:58',NULL,NULL),(72,'Pour votre activit et vos donnes quel est le critre le plus important ?','What is the most important criterion for your business and data, in terms of confidentiality, integrity and availability?','Welches ist das wichtigste Kriterium fr Ihr Unternehmen und Ihre Daten in Bezug auf Vertraulichkeit, Integritt und Verfgbarkeit?','Wat is het belangrijkste criterium voor uw activiteit en uw gegevens?',7,1,0,NULL,'2017-01-19 12:07:59',NULL,NULL),(73,'Votre activit est-elle contrainte au respect de lois, normes, rglements spcifiques (par ex. sant/mdical - loi relative  la protection des informations sur le patient) ?','Your activity must comply with laws, standards, specific regulations (eg Health / Medical right for the protection of patient information)?','Mssen Sie bei Ihren Aktivitten auf die Einhaltung von gesetzlichen Vorgaben, Normen, besonderen Bestimmungen usw. achten (z.B. im Gesundheitswesen Bestimmungen zum Schutz von Patientendaten)?','Is uw activiteit onderworpen aan wetten, normen, specifieke voorschriften (bv. gezondheid/medisch - wet inzake de bescherming van patintengegevens)?',8,1,0,NULL,'2017-01-19 12:08:00',NULL,NULL),(74,'Quelle est la menace la plus importante pour votre activit ?','What is the most important threat to your business?','Was ist die grte Bedrohung fr Ihre geschftlichen Aktivitten?','Wat vormt de grootste bedreiging voor uw activiteit?',9,1,0,NULL,'2017-01-19 12:08:00',NULL,NULL),(75,'Quelles sont vos plus grandes craintes (ce qui pourrait anantir votre activit)?','What are your biggest fears (Those that could destroy your business)?','Was sind Ihre grten Befrchtungen (solche, die Ihr Unternehmen zerstren knnten)?','Wat zijn uw grootste angsten (voor dingen die uw activiteit zouden kunnen vernietigen)?',10,1,0,NULL,'2017-01-19 12:08:01',NULL,NULL),(76,'Avez-vous dj connu un sinistre ou une attaque informatique ?','Have you ever know a disaster or cyber-attack?','Haben Sie jemals einen Katastrophenfall oder einen Cyberangriff erlebt?','Hebt u al ooit een informaticaramp of -aanval meegemaakt?',11,1,0,NULL,'2017-01-19 12:08:02',NULL,NULL),(77,'Vos concurrents ont-ils dj connu un sinistre ou attaque informatique ?','Have your competitors ever experienced a disaster or cyber-attack?','Haben Ihre Konkurrenten jemals einen Katastrophenfall oder einen Cyberangriff erlebt?','Hebben uw concurrenten al ooit een informaticaramp of -aanval meegemaakt?',12,1,0,NULL,'2017-01-19 12:08:02',NULL,NULL),(78,'Votre environnement gographique vous prdispose-t-il  un risque de type (inondation, feu, tempte, fortes neiges...)','Is your geographic environment susceptible to flooding, fire, storm, heavy snow?','Gibt es bei Ihnen aufgrund der geografischen Lage ein erhhtes Risiko fr Hochwasser, Feuer, Sturm oder starke Schneeflle?','Vertoont uw bedrijf een geografische ligging die het vatbaar maakt voor bepaalde risicos (overstroming, brand, storm, zware sneeuwval...)?',13,1,0,NULL,'2017-01-19 12:08:03',NULL,NULL);
