INSERT INTO `referentials` VALUES ('3f4a2a67-a1f9-46e1-8d71-7f6486217bb7','NIS Directive','NIS Directive','NIS Directive','NIS Directive',NULL,'2019-09-12 10:45:21',NULL,NULL),('831acc76-2bcc-4376-836a-f6b0ee6df568','ISO/IEC 27002 [2022]','ISO/IEC 27002 [2022]','ISO/IEC 27002 [2022]','ISO/IEC 27002 [2022]',NULL,'2022-02-21 15:20:04',NULL,NULL),('98ca84fb-db87-11e8-ac77-0800279aaa2b','ISO/IEC 27002 [2013]','ISO/IEC 27002 [2013]','ISO/IEC 27002 [2013]','ISO/IEC 27002 [2013]',NULL,'2019-02-28 22:55:39',NULL,NULL),('cfd2cd50-95fa-4143-b0e5-794249bacae1','NIST SP 800-53','NIST SP 800-53','NIST SP 800-53','NIST SP 800-53',NULL,'2019-03-01 12:45:05',NULL,NULL),('fcf78560-3d12-42ba-8f4a-5761ca02ac94','NIST Core','NIST Core','NIST Core','NIST Core',NULL,'2019-03-01 12:58:41',NULL,NULL);
