INSERT INTO `rolf_risks` VALUES (1,'1','Absence de tenue d\'un registre des activits de traitement','Lack of records of processing activities','Fehlende Aufzeichnungen von Verarbeitungsaktivitten','Niet bijhouden van een register van de verwerkingsactiviteiten','Existe-t-il un registre des traitements ?\nFormel ? Est-il  jour ? \nTous les traitements de l\'organisme sont-ils inventoris et repris dans le registre ?\nExiste-t-il des collectes de DCP sans connaissance claire des finalits ?\nCas 1 : Responsable du traitement\n   - Voir Art 30.1 pour l\'information minimum  renseigner\nCas 2 : Sous traitant\n   - Voir Art 30.2 pour l\'information minimum  renseigner\nNote : Voir exceptions sur le nombre d\'employs (250) et catgories de DCP\n(Art 30)','Is there any records of processing activities?\nFormal? Are there up to date?\nIs there any inventory of all treatments of the organism? Are there included in the records?\nAre there personal data collections without clear knowledge of the purposes?\nCase 1: Controller\n    - See Art 30.1 for the minimum information to be filled in\nCase 2: Processor\n    - See Art 30.2 for the minimum information to be filled in\nNote: See exceptions base on the number of employees (250) or personal data categories\n(Art. 30)','Existieren  Aufzeichnungen von Verarbeitungsaktivitten?\nFormal? Sind sie auf dem neuesten Stand?\nExistiert Inventar aller Behandlungen des Organismus? Ist es in den Aufzeichnungen enthalten?\nWerden personenbezogene Daten ohne ein klares Verstndnis der Zwecke erhoben?\nFall 1: Verantwortlicher\n    - Siehe Art 30.1 fr die einzugebenden Mindestinformationen.\nFall 2: Auftragsverarbeiter\n    - Siehe Art 30.2 fr die einzugebenden Mindestinformationen.\nHinweis: Siehe Ausnahmen basierend auf der Mitarbeiteranzahl (250) oder Kategorien personenbezogener Daten\n(Art. 30).','Bestaat er een register van de verwerkingen?\nIs het formeel? Is het up-to-date? \nWorden alle verwerkingen van het organisme genventariseerd en opgenomen in het register?\nBestaan er PG-verzamelingen zonder een duidelijke kennis van de doelstellingen?\nGeval 1: verantwoordelijke voor de gegevensverwerking\n   - zie art. 30.1 voor de minimaal te verstrekken informatie\nGeval 2: onderaannemer\n   - zie art. 30.2 voor de minimaal te verstrekken informatie\nOpmerking: zie uitzonderingen op het aantal werknemers (250) en PG-categorien\n(art. 30)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(2,'2','Absence de procdure de gestion des rclamations ou plaintes','Lack of complaint management procedure','Fehlendes Beschwerdenmanagementverfahren','Gebrek aan procedure voor de behandeling van klachten','Existe-t-il une procdure de rclamations ?\nY a-t-il un suivi, un dlai de traitement de la plainte ?\n(Art 24)','Is there a complaint procedure?\nIs there a follow-up?\nIs a delay in processing the complaint?\n(Art. 24)','Existiert ein Beschwerdeverfahren?\nExistiert eine Nachverfolgung?\nWird die Verarbeitung von Beschwerden verzgert?\n(Art. 24)','Bestaat er een klachtenprocedure?\nIs er een follow-up, een klachtenbehandelingstermijn?\n(art. 24)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(3,'3','Absence de procdure de notification  la commission d\'une violation de DCP','Lack of procedure for notifying the commission of a breach of personal data','Fehlendes Verfahren zur Benachrichtigung der Kommission ber eine Verletzung personenbezogener Daten','Gebrek aan een procedure om een PG-schending te melden aan de commissie','Existe-t-il une procdure de notification ? Formelle ?\nReprend-elle toutes les informations minimales  fournir ?\n -  destination de la commission (72h) ?\n -  destination de la personne concerne ?\n(Art 33 et 34)','Is there a notification procedure? Formal?\nDoes it take all the minimum information to provide?\n  - To the commission (72h)?\n  - To the data subject?\n(Art. 33 and 34)','Existiert ein Benachrichtigungsverfahren? Formal?\nbermittelt es alle bereitzustellenden Mindestinformationen?\n  - An die Kommission (72Std.)?\n  - An die Betroffenen?\n(Art. 33 und 34)','Bestaat er een meldingsprocedure? Is ze formeel?\nBevat ze al de minimaal te verstrekken informatie?\n - bestemd voor de commissie (72h)?\n - bestemd voor de betrokken persoon?\n(art. 33 en 34)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(4,'4','Dfaut de politique de protection des DCP','Lack of appropriate data protection policies','Fehlen von geeigneten Datenschutzrichtlinien','Gebrek aan beleid inzake de bescherming van de PG','Lorsque c\'est proportionn au regard des activits de traitement :\n  - Existe-t-il un cadre de protection de la vie prive ? Politique ? Charte ?\n  - Les employs en ont-ils connaissance des mesures prises ? \n(Art 24)','When proportionate to treatment activities:\n   - Is there a privacy framework? Policies? Charters ?\n   - Are employees aware of the actions taken?\n(Art. 24)','Wenn proportional zu Behandlungsaktivitten:\n   - Existiert ein Datenschutzrahmen? Richtlinien? Satzungen?\n   - Sind sich die Mitarbeiter ber die ergriffenen Manahmen bewusst?\n(Art. 24)','Wanneer het evenredig is met de verwerkingsactiviteiten:\n  - Bestaat er een kader voor de bescherming van de persoonlijke levenssfeer? Beleid? Charter?\n  - Zijn de werknemers op de hoogte van de getroffen maatregelen? \n(art. 24)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(5,'43','Absence de rgles d\'entreprise contraignantes','Absence of binding corporate rules','Fehlen von verbindlichen internen Datenschutzvorschriften','Gebrek aan bindende bedrijfsvoorschriften','Pour tous les dtails concernant les \"rgles d\'entreprise contraignantes\" voir article 47.\r\nSi les articles 46 et 47 ne peuvent tre respects et que le transfert doit quand mme tre fait, voir les articles :\r\n  - 48 : Transferts ou divulgations non autoriss par le droit de l\'Union\r\n  - 49 : Drogations pour des situations particulires\r\nNote :  ce point, une tude approfondie doit tre mene, pour avoir la certitude de respecter le GDPR pour sa partie \"Transferts\"\r\n(Art 47, 48, 49)','For full details on \"binding corporate rules\" see Article 47.\r\nIf sections 46 and 47 cannot be complied with and the transfer still needs to be made, see:\r\n   - 48: Transfers or disclosures not authorized by Union law\r\n   - 49: Derogations for special situations\r\nNote: At this point, an in-depth study must be carried out, in order to be sure of respecting the GDPR for its \"Transfers\"\r\n(Art. 47, 48, 49)','Einzelheiten ber \"verbindliche interne Datenschutzvorschriften\" siehe Artikel 47.\r\nMuss eine bertragung erfolgen, obwohl Abschnitte 46 und 47 nicht erfllt werden knnen, siehe:\r\n   - 48: Laut EU-Vorschriften unzulssige bertragungen oder Verffentlichungen \r\n   - 49: Ausnahmen fr Sonderflle\r\nHinweis: An dieser Stelle muss eine eingehende Studie durchgefhrt werden, um die Einhaltung der DSGVO fr die \"bertragungen\" sicherzustellen.\r\n(Art. 47, 48 und 49)','Voor alle details over \"bindende bedrijfsvoorschriften\" zie artikel 47.\r\nAls artikelen 46 en 47 niet kunnen worden nageleefd en de doorgifte toch moet plaatsvinden, zie artikelen:\r\n  - 48: Niet bij Unierecht toegestane doorgiften of verstrekkingen\r\n  - 49: Afwijkingen voor specifieke situaties\r\nOpmerking: op dit punt dient een grondige studie te worden gemaakt, om te waarborgen dat de AVG voor het gedeelte Doorgiften wordt nageleefd\r\n(art. 47, 48, 49)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(6,'42','Le niveau de protection du pays tiers est inadquat','Inadequate level of protection of the third country','Unzureichendes Schutzniveau des Drittlandes','Het beschermingsniveau van het derde land is inadequaat','Existe-t-il des transferts successifs ?\nQuel est le pays tiers ? Comment est jug son niveau de protection ?\nPrsence d\'engagements internationaux ?\nQuelle est la position de la commission  propos de ce pays tiers ?\nNote : Voir le journal officiel de l\'Union europenne pour la catgorisation des pays en matire de protection des donnes.\n(Art 44, 45)','Are there successive transfers?\nWhat is the third country? How is its level of protection judged?\nPresence of international commitments?\nWhat is the position of the Commission on this third country?\nNote: See the Official Journal of the European Union for the categorization of countries in the field of data protection.\n(Art. 44, 45)','Gibt es sukzessive bertragungen?\nWelches Land ist das Drittland? Wie wird das Schutzniveau beurteilt?\nBestehen internationale Verpflichtungen?\nWelche Position vertritt die Kommission gegenber diesem Drittland?\nHinweis: Siehe das Amtsblatt der Europischen Union fr die Kategorisierung von Lndern hinsichtlich des Datenschutzes.\n(Art. 44 und 45)','Is er sprake van opeenvolgende doorgiften?\nWelk is het derde land? Hoe wordt zijn beschermingsniveau ingeschat?\nBestaan er internationale verbintenissen?\nWat is de positie van de commissie aangaande dit derde land?\nOpmerking: zie het officile journaal van de Europese Unie voor de classificatie van landen op het vlak van gegevensbescherming.\n(art. 44, 45)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(7,'40','Le sous-traitant ne prsente pas les garanties suffisantes pour assurer la protection des donnes','The processor does not have sufficient guarantees to ensure data protection','Der Auftragsverarbeiter hat keine ausreichenden Garantien zur Gewhrleistung des Schutzes von Daten.','De onderaannemer kan niet voldoende garanties geven om de bescherming van de gegevens te waarborgen','Y a-t-il des contrles priodiques ?  Des audits?  Des certifications ?\nApplication d\'un code de conduite approuv comme le prvoit l\'article 40 ou d\'un mcanisme de certification approuv ?\n(Art 28.1, 28.2, 28.5)','Are there periodic checks? Audits? Certificates?\nApplying an approved code of conduct as provided for in section 40 or an approved certification mechanism?\n(Art 28.1, 28.2, 28.5)','Gibt es periodische berprfungen? Audits? Zertifikate?\nAnwendung eines genehmigten Verhaltenskodex wie in Abschnitt 40 vorgesehen oder eines genehmigten Zertifizierungsmechanismus?\n(Art 28.1, 28.2 und 28.5)','Zijn er periodieke controles?  Audits?  Certificeringen?\nToepassing van een goedgekeurde gedragscode zoals bepaald in artikel 40 of van een goedgekeurd certificeringsmechanisme?\n(art. 28.1, 28.2, 28.5)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(8,'41','Les instructions du responsable du traitement ne sont pas documentes','Instructions from the controller are not documented','Anleitungen des Verantwortlichen werden nicht dokumentiert.','De instructies van de verwerkingsverantwoordelijke zijn niet gedocumenteerd','Les instructions du responsable du traitement sont gnriques ? Prcises ? Interprtables ? \nDroits de transfert des donnes ?\ntat de l\'art en scurit de l\'information ? (Art  32) \n(Art 28.3)','The instructions of the controller are generic? Accurate? Interpretable?\nRight to transfer personal data?\nState of the art in information security? (Art. 32)\n(Art 28.3)','Sind die Anleitungen des Verantwortlichen allgemein? Przise? Interpretierbar?\nRecht zum bertragen personenbezogener Daten?\nDatenschutz auf dem Stand der Technik? (Art. 32)\n(Art 28.3)','Zijn de instructies van de verwerkingsverantwoordelijke generisch? Nauwkeurig? Interpreteerbaar? \nGegevensdoorgifterechten?\nHet allernieuwste inzake informatiebeveiliging? (art. 32) \n(art. 28.3)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(9,'6','Finalits inadquates au regard des missions de l\'organisme','The purposes of processing and the missions of the organization are not in adequacy','Die Zwecke der Verarbeitung und der Auftrge der Organisation sind nicht adquat.','Inadequate doeleinden met het oog op de taken van het organisme','Quels sont les domaines d\'activit de l\'organisme ?\nQuelle est la finalit du traitement ? Quel est le rapport entre l\'organisme et la personne concerne ?\nLes DCP sont rutilises pour d\'autres finalits ? Transfert ?  Statistiques ? Autres traitements ?\n(Art 5.1a, 5.1b)','What are the organization\'s areas of activity?\nWhat is the purpose of the processing? What is the relationship between the organization and the data subject?\nThe personal data are reused for other purposes? Transfer? Statistics ? Other processing?\n(Art 5.1a, 5.1b)','In welchen Ttigkeitsbereichen ist die Organisation aktiv?\nWelchem Zweck dient die Verarbeitung? Welche Beziehung besteht zwischen der Organisation und dem Betroffenen?\nWerden die personenbezogenen Daten fr andere Zwecke wiederverwendet? bertragung? Statistik? Andere Verarbeitung?\n(Art 5.1a und 5.1b)','Welke zijn de activiteitsdomeinen van het organisme?\nWat is het doel van de verwerking? Wat is de relatie tussen het organisme en de betreffende persoon?\nWorden de PG hergebruikt voor andere doeleinden? Doorgifte?  Statistieken? Andere verwerkingen?\n(art. 5.1a, 5.1b)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(11,'11','Le responsable du traitement n\'est pas identifi ou son rle et ses responsabilits ne sont pas non dfinis','Unidentified controller or undefined role and responsibility','Nicht identifizierter Verantwortlicher oder nicht definierte Rolle und Zustndigkeit','De verwerkingsverantwoordelijke wordt niet gedentificeerd of zijn rol en zijn verantwoordelijkheden zijn niet gedefinieerd','Qui est le responsable du traitement ?\nQuelle est sa fonction ? Ses responsabilits ?\nA-t-il le pouvoir de faire respecter toutes ses obligations ?\n(Art 5.2)','Who is the controller for the processing?\nWhat is its function ? His responsibilities?\nDoes it have the power to enforce all its obligations?\n(Art. 5.2)','Wer ist der Verantwortliche fr die Verarbeitung?\nWelche Funktion hat er? Seine Zustndigkeiten?\nHat er die Befugnisse zur Durchsetzung all seiner Verpflichtungen?\n(Art. 5.2)','Wie is de verwerkingsverantwoordelijke?\nWat is zijn functie? Zijn verantwoordelijkheden?\nIs hij bevoegd om al deze verplichtingen te doen naleven?\n(art. 5.2)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(12,'10','La dure de conservation des DCP est inadquate','The period for which the personal data will be stored is inadequate','Die Speicherfrist fr die personenbezogenen Daten ist inadquat.','De PG-bewaringsduur is inadequaat','La dure de conservation des DCP est-elle dtermine en fonction de la finalit du traitement ?\nQuels sont les critres utiliss pour dterminer la dure de conservation des DCP?\nY a-t-il un besoin de conserver toutes les DCP (minimisation des donnes) ?\n(Art 5.1e)','Is the period for which the personal data will be stored determined according to the purpose of the processing?\nWhat criteria are used to determine the period for which the personal data will be stored?\nIs there a need to maintain all personal data (data minimization)?\n(Art 5.1e)','Wird die Speicherfrist der personenbezogenen Daten gem dem Verarbeitungszweck bestimmt?\nWelche Kriterien werden zur Bestimmung der Speicherfrist von personenbezogenen Daten verwendet?\nMssen alle personenbezogenen Daten gepflegt werden (Datenminimierung)?\n(Art 5.1e)','Wordt de PG-bewaringsduur bepaald door het doel van de verwerking?\nWelke criteria worden gehanteerd om de PG-bewaringsduur te bepalen?\nIs het noodzakelijk om alle PG te bewaren (beperking van het aantal gegevens)?\n(art. 5.1e)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(14,'8','Le traitement des DCP n\'est pas licite','Lawfulness of the personal data processing','Rechtmigkeit der Verarbeitung personenbezogener Daten','De verwerking van de PG is niet rechtmatig','Quelle est la condition de licit ?\n a) Collecte directe du consentement de la personne\n b) Traitement ncessaire  l\'excution d\'un contrat\n c)  Respect d\'une obligation lgale\n d) Sauvegarde des intrts vitaux\n e) Excution d\'une mission d\'intrt public\n f) Traitement ncessaire aux fins des intrts lgitimes\n(Art 6.1)','What is the condition of lawfulness?\n  a) Direct collection of the consent of the person\n  b) Processing is necessary for the performance of a contract\n  c) Necessary for compliance with a legal obligation\n  d) Necessary in order to protect the vital interests of the data subject\n  e) Necessary for the performance of a task carried out in the public interest\n  f) Necessary for the purposes of the legitimate interests\n(Art. 6.1)','Welche Bedingungen bestehen fr die Rechtmigkeit?\n  a) Direkte Einholung der Einwilligung der Person\n  b) Verarbeitung ist fr die Erfllung eines Vertrags erforderlich\n  c) Notwendigkeit fr die Einhaltung einer gesetzlichen Verpflichtung\n  d) Notwendigkeit zum Schutz der lebenswichtigen Interessen einer betroffenen Person\n  e) Notwendigkeit fr die Erfllung einer im ffentlichen Interesse ausgefhrten Aufgabe\n  f) Notwendigkeit fr die Zwecke legitimer Interessen\n(Art. 6.1)','Wat zijn de voorwaarden om rechtmatig te zijn?\n a) betrokkene heeft rechtstreeks toestemming gegeven\nb) verwerking noodzakelijk voor de uitvoering van een overeenkomst\nc)  om te voldoen van de wettelijke verplichting\nd) om vitale belangen te beschermen\ne) voor de vervulling van een taak van algemeen belang\nf) voor de behartiging van de gerechtvaardigde belangen\n(art 6.1)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(15,'7','Collecte excessive de DCP au regard de la finalit du traitement','Excessive collect of personal data according to the purpose of the processing','Exzessive Erhebung personenbezogener Daten je nach Zweck der Verarbeitung','Excessieve verzameling van PG in verhouding tot het doel van de verwerking','Adquates, pertinentes et limites  ce qui est ncessaire au regard des finalits ?\nEst-ce que le principe de minimisation des donnes est respect ?\nLes donnes collectes permettent-elles d\'atteindre la finalit du traitement ?\nSont-elles compatibles avec celle-ci ?\nSont-elles  jour ?\n(Art 5.1c, 5.1d)','Adequate, relevant and limited to what is necessary in view of the purposes?\nIs the data minimization principle respected?\nDo the data collected, help to achieve the purpose of the processing?\nAre they compatible with it?\nAre they up to date?\n(Art 5.1c, 5.1d)','Adquat, relevant und beschrnkt auf das im Hinblick auf die Zwecke Notwendige?\nWird das Prinzip der Datenminimierung bercksichtigt?\nHelfen die erhobenen Daten, den Verarbeitungszweck zu erfllen?\nSind sie damit kompatibel?\nSind sie auf dem neuesten Stand?\n(Art. 5.1c und 5.1d)','Adequaat, pertinent en beperkt tot wat noodzakelijk is voor het beoogde doel?\nWordt het principe van een minimale gegevensverwerking gerespecteerd?\nMaken de verzamelde gegevens het mogelijk het doel van de verwerking te realiseren?\nZijn ze verenigbaar met het doel?\nZijn ze up-to-date?\n(art. 5.1c, 5.1d)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(16,'15','Aucun moyen permettant l\'exercice du droit de rtractation du consentement','No means to allow the exercise of the right of withdrawal of consent','Keine die Ausbung des Rechts auf Widerruf der Einwilligung ermglichenden Mittel','Geen middel om het recht om de toestemming in te trekken uit te oefenen','Le retrait du consentement est possible :\n -  tout moment ?\n - Sans justification ?\n - Facilement accessible?\n - La personne sait-elle qu\'elle peut retirer son consentement ?\n(Art 7.3)','The withdrawal of consent is possible:\n  - At anytime?\n  - No justification?\n  - Easily accessible?\n  - Does the person know that they can withdraw its consent?\n(Art. 7.3)','Der Widerruf der Einwilligung ist mglich:\n  - Jederzeit?\n  - Ohne Begrndung?\n  - Einfach zugnglich?\n  - Wei die Person, dass sie ihre Einwilligung widerrufen kann?\n(Art. 7.3)','Is het intrekken van de toestemming:\n - te allen tijde mogelijk?\n - zonder rechtvaardiging mogelijk?\n - gemakkelijk toegankelijk?\n - weet de persoon dat hij of zij zijn/haar toestemming kan intrekken?\n(art. 7.3)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(17,'14','Absence de consentement du responsable parental des enfants (< 16 ans)','Lack of the consent given or authorized by the holder of parental responsibility over the child (< 16 years old)','Fehlen der vom Trger der elterlichen Verantwortung fr ein Kind (< 16 Jahre) gegebenen oder genehmigten Einwilligung','Geen toestemming van de persoon met de ouderlijke verantwoordelijkheid over de kinderen (< 16 jaar)','Qui donne le consentement ? \nExiste-t-il une vrification de la responsabilit parentale de l\'enfant ?\n(Art 8)','Who gives the consent?\nIs there a verification of parental responsibility over the child?\n(Art. 8)','Wer erteilt die Einwilligung?\nWird die elterliche Verantwortung fr das Kind berprft?\n(Art. 8)','Wie geeft de toestemming? \nBestaat er een controle van de ouderlijke verantwoordelijkheid over het kind?\n(art. 8)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(18,'13','Les preuves de la collecte du consentement sont insuffisantes','Insufficient evidence of the consent collection','Unzureichender Nachweis der Einwilligungseinholung','De bewijzen van de verkrijging van de toestemming zijn ontoereikend','Le consentement peut-il tre dmontr ?\nPreuves physiques ? lectroniques ?\n(Art 7.1)','Can consent be demonstrated?\nPhysical Evidence? Electronics?\n(Art. 7.1)','Kann die Einwilligung nachgewiesen werden?\nPhysische Beweise? Elektronik?\n(Art. 7.1)','Kan de toestemming worden aangetoond?\nFysieke bewijsstukken? Elektronische?\n(art. 7.1)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(19,'12','Collecte dloyale du consentement','Unfair collection of the data subject\'s consent','Unfaire Einholung der Einwilligung von Betroffenen','Oneerlijke verkrijging van de toestemming','Le consentement est-il :\n - Explicite ? \n - Positif ?\n - Libre ?\n - Spcifique au traitement ou  un contrat ? \n - Clairement distinct des autres lments ?\n(Art 7.2, 7.4)','Is the consent:\n  - Explicit?\n  - Positive?\n  - Free?\n  - Specific to the processing or the contract?\n  - Clearly distinct from other elements (of the contract)?\n(Art 7.2, 7.4)','Erfolgt die Einwilligung:\n  - Ausdrcklich?\n  - Positiv?\n  - Freiwillig?\n  - Spezifisch fr die Verarbeitung oder den Vertrag?\n  - Klar getrennt von anderen Elementen (des Vertrags)?\n(Art 7.2 und 7.4)','Is de toestemming:\n - expliciet? \n - positief?\n - vrij?\n - specifiek voor de verwerking of voor een overeenkomst? \n - duidelijk onderscheiden van de andere elementen?\n(art. 7.2, 7.4)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(20,'16','Manque d\'information  la personne sur la faon d\'exercer ses droits','Lack of information to the data subject on how to exercise its rights','Fehlende Belehrung des Betroffenen ber die Ausbung seiner Rechte','De persoon beschikt niet over informatie over de manier waarop hij/zij zijn/haar rechten kan doen gelden','Comment exercer la demande ? Par mail ? Courrier ? Personnellement ?\nLa demande est-elle gratuite ?\n(Chapitre III)','How to apply? By email? Postal mail? Personally?\nIs the application free?\n(Chapter III)','Beantragungsmethode? Per E-Mail? Per Post? Persnlich?\nIst die Beantragung gebhrenfrei?\n(Kapitel III)','Hoe het verzoek indienen? Per mail? Post? Persoonlijk?\nIs het verzoek gratis?\n(Hoofdstuk III)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(21,'17','Les ressources sont insuffisantes pour assurer l\'exercice des droits de la personne concerne','Insufficient resources to ensure the exercise of the data subject\'s rights','Unzureichende Ressourcen zur Gewhrleistung der Ausbung der Rechte von Betroffenen','De middelen zijn ontoereikend om de uitoefening van de rechten van de betrokken persoon mogelijk te maken','Comment sont traites les demandes ?\n(Chapitre III)','How requests are processed?\n(Chapter III)','Wie werden Anfragen verarbeitet?\n(Kapitel III)','Hoe worden de verzoeken behandeld?\n(Hoofdstuk III)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(22,'18','Les dlais de rponse des demandes sont excessifs','Excessive response time for answering requests','Zu lange Antwortzeit auf Anfragen','De termijnen voor het beantwoorden van de verzoeken zijn te lang','Quelle est la frquence de rception de demandes ?\n(Chapitre III)','How often are requests received?\n(Chapitre III)','Wie oft werden Anfragen erhalten?\n(Kapitel III)','Wat is de ontvangstfrequentie van verzoeken?\n(Hoofdstuk III)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(23,'19','Dfaut de contrle d\'identit du demandeur des droits','Lack of identity check of the applicant','Fehlende Identittsprfung eines Antragstellers','Geen identiteitscontrole van de aanvrager van de rechten','Existe-t-il une procdure de contrle de l\'identit ? Est-elle formelle ?\nQuel type de document est demand ?\nLe document est-il copi ? Stock ?','Is there a procedure for identity control? Is it formal?\nWhat type of document is requested?\nIs the document copied? Stored?\n(Chapitre III)','Existiert ein Verfahren fr die Identittskontrolle? Ist es formal?\nWelcher Typ von Dokumenten wird verlangt?\nWird das Dokument kopiert? Aufbewahrt?\n(Kapitel III)','Bestaat er een identiteitscontroleprocedure? Is ze formeel?\nWelk type document wordt gevraagd?\nWordt het document gekopieerd? Opgeslagen?',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(24,'21','L\'information pralable  fournir  la personne est insuffisante','Prior information to be provided to the person is insufficient','Der Person bereitzustellende Vorabinformationen sind unzureichend.','De vooraf aan de persoon te verstrekken informatie is ontoereikend','Attention l\'information varie sensiblement en fonction de la faon de collecter l\'information (auprs de la personne art. 13, sinon art. 14)\nInformation  fournir au minimum :\n - L\'identit et les coordonnes du responsable du traitement ou du dlgu  la protection des donnes\n - Les finalits du traitement\n - La base juridique du traitement\n - Si le traitement est fond sur des intrts lgitimes, les fournir\n - les destinataires ou les catgories de destinataires\n - L\'intention d\'effectuer un transfert de donnes  caractre personnel vers un pays tiers ou  une organisation internationale\n - La dure de conservation des donnes ou les critres utiliss pour dterminer cette dure\n - L\'existence de ses diffrents droits\n - L\'existence d\'une prise de dcision automatise, y compris un profilage ainsi que la logique sous-jacente et  l\'importance et les consquences prvues de ce traitement pour la personne concerne\n - ...\n(Art 13.1, 13.2, 14)','Please note that information depends on how the information is collected (from the person in Article 13, if not Article 14)\nInformation to be provided as a minimum:\n - The identity and contact details of the controller or the Data Protection Officer\n - Purposes of processing\n - The legal basis for the processing\n - If the treatment is based on legitimate interests, provide them\n - Recipients or categories of recipients\n - The intention to transfer personal data to a third country or to an international organization\n - The retention period of the data or the criteria used to determine this duration\n - The existence of its various rights\n - The existence of automated decision-making, including profiling and the underlying logic and the significance and anticipated consequences of this treatment for the data subject \n - ...\n(Art. 13.1, 13.2, 14)','Bitte beachten Sie, dass Informationen davon abhngen, wie sie eingeholt werden (von einer Person in Artikel 13, ansonsten Artikel 14).\nBereitzustellende Mindestinformationen:\n - Die Identitt sowie die Kontaktdaten des Verantwortlichen oder des Datenschutzbeauftragten\n - Zweck der Verarbeitung\n - Die gesetzliche Grundlage fr die Verarbeitung\n - Falls die Behandlung auf legitimen Interessen beruht, diese angeben\n - Empfnger oder Empfngerkategorien\n - Die Absicht der bertragung personenbezogener Daten an Drittlnder oder eine internationale Organisation\n - Die Speicherfrist der Daten oder die zur Bestimmung dieser Frist verwendeten Kriterien\n - Das Bestehen der verschiedenen Rechte\n - Das Bestehen automatisierter Entscheidungsfindungen, u.a. Profilerstellung und die zugrunde liegende Logik sowie die Bedeutung und die voraussichtlichen Folgen dieser Behandlung fr Betroffene \n - \n(Art. 13.1, 13.2 und 14)','Let op, de informatie verschilt aanzienlijk afhankelijk van de manier waarop de informatie wordt verzameld (bij de persoon, art. 13, anders art. 14)\nMinstens te verstrekken informatie:\n - De identiteit en de gegevens van de verwerkingsverantwoordelijke of van de functionaris voor gegevensbescherming\n - de doeleinden van de verwerking\n - de rechtsgrond van de verwerking\n - als de verwerking gebaseerd is op gerechtvaardigde belangen, moeten die worden vermeld\n - de ontvangers of de categorien van ontvangers\n - het voornemen om persoonsgegevens door te geven aan een derde land of aan een internationale organisatie\n - de periode gedurende welke de persoonsgegevens zullen worden opgeslagen of de criteria ter bepaling van die termijn\n - het bestaan van zijn verschillende rechten\n - het bestaan van geautomatiseerde besluitvorming, met inbegrip van een profilering en de onderliggende logica, alsmede het belang en de verwachte gevolgen van die verwerking voor de betrokkene\n - ...\n(art. 13.1, 13.2, 14)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(25,'20','Les preuves concernant les demandes relatives  l\'exercice de droits sont insuffisantes','Insufficient evidence concerning applications for the exercise of rights','Unzureichender Nachweis im Hinblick auf Antrge zur Ausbung von Rechten','De bewijzen betreffende de verzoeken m.b.t. de uitoefening van de rechten zijn ontoereikend','Existe-t-il un modle de demande propos  la personne concerne ?\nLes demandes sont-elles adresses par crit, dates et signes ?\n(Chapitre III)','Is there a proposed application to the data subject?\nAre applications made in writing, dated and signed?\n(Chapter III)','Wird Betroffenen ein Antrag angeboten?\nErfolgen Antrge in datierter und unterzeichneter Schriftform?\n(Kapitel III)','Bestaat er een verzoekmodel dat wordt voorgesteld aan de betrokken persoon?\nWorden de verzoeken schriftelijk ingediend, gedateerd en ondertekend?\n(Hoofdstuk III)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(26,'28','Impossible d\'exercer le droit  la limitation du traitement','Unable to exercise the right to limit the processing','Ausbung des Rechts auf Einschrnkung der Verarbeitung nicht mglich','Onmogelijk het recht op de beperking van de verwerking uit te oefenen','La personne concerne a le droit d\'obtenir du responsable du traitement la limitation du traitement lorsque l\'un des lments suivants s\'applique:\na) l\'exactitude des donnes  caractre personnel est conteste \nb) le traitement est illicite et la personne concerne s\'oppose  leur effacement et exige  la place la limitation de leur utilisation\nc) le responsable du traitement n\'a plus besoin des donnes  caractre personnel aux fins du traitement, mais celles-ci sont encore ncessaires  la personne concerne pour la constatation, l\'exercice ou la dfense de droits en justice;0\nd) la personne concerne s\'est oppose au traitement en vertu de l\'article 21, paragraphe 1, pendant la vrification portant sur le point de savoir si les motifs lgitimes poursuivis par le responsable du traitement prvalent sur ceux de la personne concerne.\n(Art 18.1)','The data subject shall have the right to obtain from the controller the limitation of processing where one of the following applies:\na) The accuracy of the personal data is contested\nb) The processing is unlawful and the person concerned opposes their erasure and instead requires the limitation of their use\nc) the controller no longer needs personal data for processing purposes, but the controller is still required by the data subject to establish, exercise or defend legal rights\n(D) the data subject has objected to the processing under article 21 (1) during the verification of whether the legitimate reasons pursued by the controller prevail over those of the data subject.\n(Art. 18.1)','Betroffene haben das Recht, die Einschrnkung der Verarbeitung vom Verantwortlichen zu erhalten, wenn einer der folgenden Umstnde gegeben ist:\na) Die Genauigkeit der personenbezogenen Daten wird bestritten.\nb) Die Verarbeitung ist unrechtmig, und die betroffene Person lehnt deren Lschung ab und fordert stattdessen die Einschrnkung ihrer Nutzung.\nc) Der Verantwortliche bentigt zu Verarbeitungszwecken keine personenbezogenen Daten mehr, muss auf Verlangen eines Betroffenen aber noch Rechtsansprche feststellen, geltend machen oder verteidigen.\nd) Ein Betroffener hat einer Verarbeitung gem Artikel 21 (1) whrend der berprfung widersprochen, ob die vom Verantwortlichen verfolgten legitimen Zwecke Vorrang vor denen des Betroffenen haben.\n(Art. 18.1)','De betrokkene heeft het recht van de verwerkingsverantwoordelijke de beperking van de verwerking te verkrijgen indien een van de volgende elementen van toepassing is:\na) de juistheid van de persoonsgegevens wordt betwist\nb) de verwerking is onrechtmatig en de betrokkene verzet zich tegen het wissen van de persoonsgegevens en verzoekt in de plaats daarvan om een beperking van het gebruik ervan\nc) de verwerkingsverantwoordelijke heeft de persoonsgegevens niet meer nodig voor de verwerkingsdoeleinden, maar de betrokkene heeft deze nodig voor de instelling, uitoefening of onderbouwing van een rechtsvordering\nd) de betrokkene heeft krachtens artikel 21, lid 1, bezwaar gemaakt tegen de verwerking, in afwachting van het antwoord op de vraag of de gerechtvaardigde gronden van de verwerkingsverantwoordelijke zwaarder wegen dan die van de betrokkene.\n(art. 18.1)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(27,'27','Dfaillance du contrle d\'effacement des DCP atteignant la fin de la dure de conservation','Failure to control the deletion of data reaching the end of the shelf life','Unterlassung der Kontrolle der Lschung von Daten bei Ablauf der Speicherfrist','Tekortkoming in de controle van de verwijdering van persoonsgegevens die het einde van de bewaringsduur hebben bereikt','Existe-t-il une procdure de contrle ?\nQui en est lresponsable ?\nQuelle est la priode de lancement ?\n(Art 17)','Is there a control procedure?\nWho is responsible for this?\nWhat is the launch period?\n(Art. 17)','Existiert ein Kontrollverfahren?\nWer ist dafr zustndig?\nMit welcher Einfhrungsphase?\n(Art. 17)','Bestaat er een controleprocedure?\nWie is er verantwoordelijk voor?\nWat is de lanceringsperiode?\n(art. 17)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(28,'26','Incapacit d\'effacer les DCP','Unable to delete personal data','Lschung personenbezogener Daten nicht mglich','Onvermogen om de PG te wissen','L\'obligation d\'effacer les DCP s\'applique en fonction de certains motifs : DCP plus ncessaires, retrait du consentement, opposition au traitement, traitement illicite, obligation lgale, offre de service ..)\nPossibilit de traiter l\'effacement via les autres responsables du traitement   \nNote : Il existe des exceptions pour l\'application au droit  l\'effacement (art. 17-3)\n(Art 17.1, 17.2)','The obligation to erase personal data applies on the basis of certain grounds: data no longer necessary, withdrawal of consent, opposition to processing, unlawful processing, legal obligation, offer of service ..)\nPossibility of processing erasure via other processors\nNote: There are exceptions for the application of the right of erasure (Articles 17-3)\n(Art. 17.1, 17.2)','Die Verpflichtung zur Lschung personenbezogener Daten besteht unter bestimmten Umstnden: Daten sind nicht mehr erforderlich, Widerruf der Einwilligung, Widerspruch gegen Verarbeitung, unrechtmige Verarbeitung, gesetzliche Verpflichtung, Dienstleistungsangebot\nMglichkeit der Verarbeitung der Lschung durch andere Auftragsverarbeiter\nHinweis: Fr die Anwendung des Rechts auf Lschung bestehen Ausnahmen (Artikel 17-3)\n(Art. 17.1 und 17.2).','De verplichting om de PG te wissen geldt afhankelijk van bepaalde motieven: PG niet langer nodig, intrekking van toestemming, bezwaar tegen verwerking, onrechtmatige verwerking, wettelijke verplichting, dienstenaanbod...)\nMogelijkheid om de verwijdering te behandelen via de andere verwerkingsverantwoordelijken\nOpmerking: er bestaan uitzonderingen voor de toepassing van het recht op gegevensverwijdering (art. 17-3)\n(art. 17.1, 17.2)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(29,'25','Impossibilit de rectifier les DCP qui sont inexactes','Inability to correct inaccurate personal data','Berichtigung fehlerhafter personenbezogener Daten nicht mglich','Onmogelijkheid om inexacte PG te rectificeren','La rectification est-elle possible ?  \nPartout (Duplication, diffrents supports ...) ?\n(Art 16)','Is rectification possible?\nEverywhere (Duplication, different media, ...)?\n(Art. 16)','Ist eine Berichtigung mglich?\nberall (Duplizierung, verschiedene Medien)?\n(Art. 16)','Is rectificatie mogelijk?  \nOveral (duplicatie, verschillende dragers...) ?\n(art. 16)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(30,'24','Impossibilit de tracer les personnes qui accdent aux DCP','Unable to trace people accessing the personal data','Verfolgung des Zugriffs von Personen auf personenbezogene Daten nicht mglich','Geen mogelijkheid om de personen die de PG inzien te traceren','Quelles informations sont enregistres dans les logs ?\nNom des personnes ou catgories de personnes ?\n(Art 15.1c)','What information is stored in the logs?\nName of persons or categories of persons?\n(Art 15.1c)','Welche Informationen werden in den Protokollen gespeichert?\nPersonennamen oder Personenkategorien?\n(Art. 15.1c)','Welke informatie wordt opgeslagen in de logs?\nNaam van de personen of persoonscategorien?\n(art. 15.1c)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(31,'23','Aucun moyen pour fournir une copie des DCP  la personne concerne','No means to provide a copy of the personal data to the data subject','Keine Mittel zur Bereitstellung einer Kopie personenbezogener Daten fr Betroffene','Geen mogelijkheid om de betrokken persoon een kopie van de PG te bezorgen','Comment les informations sont-elles fournies ?\nLes donnes fournies sont exhaustives ?\nDes frais administratifs sont-ils demands ? Proportionnalit ?\n(Art 15.3)','How the information is provided?\nAre the data provided exhaustive?\nAre there any administrative fees? Proportionality?\n(Art. 15.3)','Wie werden die Informationen bereitgestellt?\nSind die bereitgestellten Daten umfassend?\nFallen Verwaltungsgebhren an? Proportionalitt?\n(Art. 15.3)','Hoe worden de gegevens verstrekt?\nWorden de gegevens uitputtend verstrekt?\nWorden er administratiekosten aangerekend? Evenredigheid?\n(art. 15.3)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(32,'22','Modification du traitement ou traitement ultrieur, sans information pralable  la personne','Changes in treatment or further treatment, without prior notification to the data subject','nderungen bei der Behandlung oder weiteren Behandlung ohne vorherige Ankndigung bei Betroffenen','Wijziging van de verwerking of latere verwerking, zonder voorafgaande kennisgeving aan de persoon','Quel type de changement ?\n - Changement ou autre finalit ?\n - Nouveaux destinataires ?\n - Dure de conservation ?\n - ... ?\n(Art 13.3)','What kind of change?\n  - Change or other purpose?\n  - New recipients?\n  - The duration of the conversation ?\n  - ...?\n(Art. 13.3)','Welche Art der nderung?\n  - nderung oder anderer Zweck?\n  - Neue Empfnger?\n  - Die Speicherfrist?\n  - ?\n(Art. 13.3)','Welk type van wijziging?\n - wijziging of ander doeleinde?\n - nieuwe ontvangers?\n - bewaringsduur?\n - ... ?\n(art. 13.3)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(33,'29','Incapacit de s\'opposer au traitement de DCP','Inability to object to the processing of personal data','Widerspruch gegen die Verarbeitung von personenbezogenen Daten nicht mglich','Onvermogen om bezwaar aan te tekenen tegen de verwerking van de PG','Existe-t-il un point de contact (mail, tlphone, adresse) ?\nY a-t-il une procdure en place ?\nQuel est le temps pour arrter le traitement, aprs la demande de la personne concerne ?\nSi plusieurs traitements, possibilit d\'en arrter qu\'un ?\nNote : Voir exception\n(Art 21)','Is there a point of contact (mail, telephone, address)?\nIs there a procedure in place?\nWhat is the time to stop processing, after the request of the data subject?\nIf several processing, possibility to stop only one?\nNote: See exception\n(Art. 21)','Gibt es eine Anlaufstelle (E-Mail, Telefon, Adresse)?\nExistiert ein Verfahren?\nDauer bis zum Beenden der Verarbeitung nach dem Antrag eines Betroffenen?\nMglichkeit bei mehreren Verarbeitungen, nur eine zu beenden?\nHinweis: Siehe Ausnahme\n(Art. 21).','Bestaat er een contactpunt (mail, telefoon, adres)?\nBestaat er een procedure?\nHoelang duurt het om de verwerking stop te zetten, na het verzoek van de betrokken persoon?\nBij meerdere verwerkingen, mogelijkheid om slechts n te stoppen?\nOpmerking: Zie uitzondering\n(art. 21)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(35,'31','Incompatibilit entre les fonctions du DPO et ses missions','Incompatibility between DPO functions and missions','Inkompatibilitt zwischen DSB-Funktionen und -Auftrgen','Incompatibiliteit tussen de functies van de FGB en zijn taken','A-t-il accs aux informations pertinentes pour sa fonction, de la part du management de l\'organisme ?\nEst-il en rapport direct avec le management de l\'organisme ?\nPrsence de conflit d\'intrts avec les autres missions du DPO ? RSSI ? \nFait-il partie du management de l\'organisme ?\n(Art 38)','Does he have access to information relevant to its function, from the management of the organization?\nIs he directly related to the management of the organization?\nConflict of interest with other DPO missions? CISO?\nIs he part of the management of the organization?\n(Art. 38)','Hat er Zugriff auf fr seine Funktion relevante Informationen vom Management der Organisation?\nBestehen direkte Beziehungen zwischen ihm und dem Management der Organisation?\nInteressenskonflikt mit anderen DSB-Auftrgen? CISO (Chief Information Security Officer, Beauftragter fr Informationssicherheit)?\nGehrt er zum Management der Organisation?\n(Art. 38)','Heeft hij toegang tot pertinente informatie voor zijn functie, vanwege het management van het organisme?\nIs er een rechtstreekse relatie met het management van het organisme?\nIs er sprake van een belangenconflict met andere taken van de FGB? ISSM? \nMaakt hij deel uit van het management van het organisme?\n(art. 38)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(36,'30','Le DPO manque de comptences','Lack of skills of the DPO','Mangelnde Kompetenzen des DSB','De FGB beschikt niet over al de nodige bekwaamheden','Est-il de formation universitaire accomplie en droit ?  conomie ? Gestion d\'entreprise ? Informatique ?   ?\nEst-il membre d\'une des professions rglementes ? Avocat  la Cour ?  Rviseur d\'entreprises ? Expert-comptable ? Mdecin ?\nEst-il bien conscient de son rle et ses devoirs ?\n(Art 37.5, 39.2)','Did he have an academic background in law? Economy? Business Management ? Computing? ...?\nIs he a member of one of the regulated professions? Attorneys ? Reviewer of companies? Accountant ? Doctor ?\nIs he well aware of his role and duties?\n(Art. 37.5, 39.2)','Hat er einen akademischen Hintergrund in Rechtswissenschaften? Wirtschaft? Betriebswirtschaft? Informatik? ?\nbt er einen reglementierten Beruf aus? Anwalt? Unternehmensprfer? Buchhalter? Arzt?\nIst er sich seiner Rolle und seiner Pflichten vollkommen bewusst?\n(Art. 37.5 und 39.2)','Heeft hij een universitair diploma in de rechten?  In economie? In bedrijfsbeheer? In informatica?   ?\nIs hij lid van een van de gereglementeerde beroepen? Raadsheer bij het hof van beroep?  Bedrijfsrevisor? Accountant? Arts?\nIs hij zich terdege bewust van zijn rol en zijn plichten?\n(art. 37.5, 39.2)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(37,'33','Faible communication entre DPO et la commission','Low communication between DPO and the commission','Geringe Kommunikation zwischen dem DSB und der Kommission','Gebrekkige communicatie tussen FGB en de commissie','Veille juridique ?\nPoint de contact pour rpondre aux demandes et aux rclamations ?\n(Art 39.1d)','Legal monitoring ?\nContact point for inquiries and complaints?\n(Art 39.1d)','Rechtliche berwachung?\nAnlaufstelle fr Anfragen und Beschwerden?\n(Art. 39.1d)','Juridische waarnemingspost?\nContactpunt om te antwoorden op verzoeken en klachten?\n(art. 39.1d)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(38,'34','Faible communication entre DPO et les employs','Poor communication between the DPO and employees','Schlechte Kommunikation zwischen dem DSB und Mitarbeitern','Gebrekkige communicatie tussen FGB en de werknemers','Le DPO est-il actif dans des sujets tels que :\n - la sensibilisation ?\n - les conseils aux employs ?\n - les codes de conduites ?\n - les politiques relatives  la protection des DCP\n(Art. 39-1b)','The DPO is active in subjects such as:\n  - Awareness ?\n  - Advice to employees?\n  - Codes of conduct?\n  - Policies relating to the personal data protection\n(Article 39 (1) (b)','DSB ist aktiv in Bereichen wie:\n  - Bewusstsein?\n  - Mitarbeiterberatung?\n  - Verhaltenskodizes?\n  - Richtlinien in Bezug auf den Schutz personenbezogener Daten\n(Artikel 39 (1) (b))','Is de FGB actief op het vlak van themas als:\n - sensibilisering?\n - advies aan werknemers?\n - gedragscodes?\n - het beleid inzake de bescherming van PG\n(art. 39-1b)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(39,'35','Le destinataire ne connait pas la finalit du traitement','The recipient does not know the purpose of the processing','Der Empfnger kennt den Zweck der Verarbeitung nicht.','De ontvanger kent het doel van de verwerking niet','Quel type de lgitimit ?\n - Consentement de la personne\n - Respect  une obligation lgale\n - Excution mission d\'intrt public\n - Excution d\'un contrat\n - Ralisation d\'un intrt lgitime\n - Sauvegarde de l\'intrt vital\n(multi articles)','What kind of legitimacy?\n  - Consent of person\n  - Compliance with a legal obligation\n  - Execution of public service mission\n  - Execution of a contract\n  - Realization of a legitimate interest\n  - Safeguarding the vital interest\n(multi articles)','Welche Art der Rechtmigkeit?\n  - Einwilligung einer Person\n  - Einhaltung einer gesetzlichen Verpflichtung\n  - Erfllung ffentlicher Dienstauftrge\n  - Erfllung eines Vertrags\n  - Erfllung eines legitimen Interesses\n  - Schutz lebenswichtiger Interessen\n(Diverse Artikel)','Welk type van legitimiteit?\n - toestemming van de persoon\n - naleving van een wettelijke verplichting\n - uitvoering van een missie van algemeen belang\n - uitvoering van een contract\n - realisatie van een legitiem belang\n - verdediging van een vitaal belang\n(meerdere artikelen)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(40,'36','Les DCP sont excessives au regard de la finalit du traitement','Personal data are excessive in relation to the purpose of the processing','Zu viele personenbezogene Daten .im Verhltnis zum Verarbeitungszweck','De PG zijn excessief in verhouding tot het doel van de verwerking','Les donnes transmises permettent-elles d\'atteindre la finalit du traitement et sont-elles compatibles avec celle-ci ? \nEst-ce que le principe de minimisation des donnes est respect ?\n(Multi article)','Do the transmitted data make it possible to achieve the purpose of the processing and are they compatible with it?\nIs the data minimization principle respected?\n(Multi article)','Ermglichen die bertragenen Daten die Erfllung des Verarbeitungszwecks und sind sie damit kompatibel?\nWird das Prinzip der Datenminimierung bercksichtigt?\n(Diverse Artikel)','Maken de verstrekte gegevens het mogelijk het doel van de verwerking te realiseren en zijn ze ermee verenigbaar? \nWordt het principe van een minimale gegevensverwerking gerespecteerd?\n(meerdere artikelen)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(41,'37','Absence des clauses contractuelles entre le responsable du traitement et le destinataire','Absence of contractual clauses between the controller and the processor','Fehlende Vertragsklauseln zwischen dem Verantwortlichem und dem Auftragsverarbeiter','Gebrek aan contractuele bepalingen tussen de verwerkingsverantwoordelijke en de ontvanger','Obligations en matire de protection des DCP\nLimites du traitement sous instruction du responsable du traitement\n(multi articles)','Obligations regarding personal data protection\nThe limits of the processing under instruction of the controller\n(multi articles)','Verpflichtungen in Bezug auf den Schutz personenbezogener Daten\nEinschrnkungen der Verarbeitung unter Anleitung des Verantwortlichen\n(Diverse Artikel)','Verplichtingen inzake de bescherming van PG\nBeperkingen van de verwerking in opdracht van de verwerkingsverantwoordelijke\n(meerdere artikelen)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(43,'39','Absence des clauses contractuelles entre le responsable du traitement et le sous-traitant','Lack of contractual clauses between the controller and the processor','Fehlende Vertragsklauseln zwischen dem Verantwortlichen und dem Auftragsverarbeiter','Gebrek aan contractuele afspraken tussen de verwerkingsverantwoordelijke en de onderaannemer','Les obligations  dfinir : l\'objet et la dure du traitement, la nature et la finalit du traitement, le type de donnes  caractre personnel et les catgories de personnes concernes, et les obligations et les droits du responsable du traitement.\nLes documents sont-ils formels ?\n(Ar 28.3, 28.9)','The obligations to be defined: the purpose and duration of processing, the nature and purpose of the processing, the type of personal data and the categories of data subjects, and the obligations and rights of the controller.\nAre the documents formal?\n(Art 28: 3, 28: 9)','Festzulegende Verpflichtungen: Zweck und Dauer der Verarbeitung, Art und Zweck der Verarbeitung, Typ der personenbezogenen Daten und Betroffenenkategorien sowie die Verpflichtungen und Rechte des Verantwortlichen\nSind die Dokumente formal?\n(Art 28: 3 und 28: 9)','De te definiren verplichtingen: het voorwerp en de duur van de verwerking, de aard en het doel van de verwerking, het type van persoonsgegevens en de categorien van de betrokken personen, en de verplichtingen en rechten van de verwerkingsverantwoordelijke.\nZijn de documenten formeel?\n(art. 28.3, 28.9)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(44,'44','L\'information concernant les droits daccs  fournir  la personne est insuffisante','Information on the access rights to be provided to the person is insufficient','Der Person bereitzustellende Informationen ber Auskunftsrechte sind unzureichend.','De aan de persoon te verstrekken informatie betreffende de toegangsrechten is ontoereikend','Comment les informations sont-elles fournies ?\nInformation  fournir au minimum :\n - Les finalits du traitement\n - Les catgories des DCP et leurs sources\n - les destinataires ou les catgories de destinataires\n - La dure de conservation des donnes ou les critres utiliss pour dterminer cette dure\n - L\'existence de ses diffrents droits\n - L\'existence d\'une prise de dcision automatise, y compris le profilage\n - Si transfert des DCP vers un pays tiers ou  une organisation internationale, information sur les garanties appropries\n - ...\n(Art 15.1, 15.2)','How is the information provided?\nInformation to be provided as a minimum:\n  - Purposes of processing\n  - Categories of personal data and their sources\n  - recipients or categories of recipients\n  - The retention period of the data or the criteria used to determine this duration\n  - The existence of its various rights\n  - The existence of automated decision-making, including profiling\n  - If transfer of personal data to a third country or to an international organization, information on the appropriate safeguards\n  - ...\n(Art. 15.1, 15.2)','Wie sind die Informationen bereitzustellen?\nBereitzustellende Mindestinformationen:\n  - Zwecke der Verarbeitung\n  - Kategorien personenbezogener Daten und deren Quellen\n  - Empfnger oder Empfngerkategorien\n  - Die Speicherfrist der Daten oder die zur Bestimmung dieser Frist verwendeten Kriterien\n  - Das Bestehen der verschiedenen Rechte\n  - Das Bestehen automatisierter Entscheidungsfindungen, u.a. Profilerstellung\n  - Informationen ber die geeigneten Garantien bei bertragung personenbezogener Daten an Drittlnder oder eine internationale Organisation \n  - \n(Art. 15.1 und 15.2)','Hoe worden de gegevens verstrekt?\nMinimaal te verstrekken informatie:\n  - de doeleinden van de verwerking\n - de categorien van PG en hun bronnen\n - de ontvangers of de ontvangercategorien\n - de gegevensbewaringsduur of de gehanteerde criteria om die duur te bepalen\n - het bestaan van zijn verschillende rechten\n - het bestaan van een automatische besluitvorming, inclusief profilering\n - in geval van doorgifte van de PG aan een derde land of aan een internationale organisatie, relevante informatie over de garanties\n - ...\n(art. 15.1, 15.2)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(46,'46','Le responsable du traitement ne met pas les moyens en oeuvre pour limiter le traitement','The controller does not implement the means to limit the processing','Der Verantwortliche implementiert die Mittel zur Einschrnkung der Verarbeitung nicht.','De verwerkingsverantwoordelijke maakt geen gebruik van de middelen om de verwerking te beperken','En cas de limitation du traitement, quelles sont les mesures prises par le responsable du traitement pour assurer la limitation ?\nEn cas de leve de la limitation comment la personne concerne sera-t-elle avertie?\nNote : Voir exceptions\n(Art 18.2, 18.3)','If the processing is restricted, what measures are taken by the controller to ensure the limitation?\nIf the limitation is lifted, how will the person concerned be notified?\nNote: See exceptions\n(Art. 18.2, 18.3)','Welche Manahmen werden vom Verantwortlichen bei eingeschrnkter Verarbeitung zur Sicherstellung der Beschrnkung ergriffen?\nWie wird die betroffene Person im Falle der Aufhebung der Einschrnkung benachrichtigt?\nHinweis: Siehe Ausnahmen\n(Art. 18.2 und 18.3).','Welke maatregelen neemt de verwerkingsverantwoordelijke in geval van beperking van de verwerking om die beperking te waarborgen?\nHoe wordt de betrokken persoon in geval van opheffing van de beperking daarvan verwittigd?\nOpmerking: Zie uitzonderingen\n(art. 18.2, 18.3)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(47,'47','La notification  chaque destinataire  qui les DCP ont t communiques n\'est pas faite','Notification to each recipient to whom personal data has been communicated is not provided','Keine Benachrichtigung an jeden Empfnger, dem personenbezogene Daten mitgeteilt wurden','De kennisgeving aan iedere ontvanger aan wie de PG werden verstrekt, vindt niet plaats','Valable pour la rectification, l\'effacement des donnes et la limitation du traitement\n(Art 19)','Valid for rectification, erasure of data and limitation of processing\n(Art. 19)','Gilt fr Berichtigung, Lschung von Daten und Einschrnkung der Verarbeitung\n(Art. 19)','Geldig voor rectificatie, gegevenswissing en verwerkingsbeperking\n(art. 19)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(48,'48','Incapacit  exercer le droit  la portabilit des donnes','Inability to exercise the right to data portability','Ausbung des Recht auf Datenbertragbarkeit nicht mglich','Onvermogen het recht op de overdraagbaarheid van gegevens uit te oefenen','Quel format de donnes est prvu ? \nStructur ? Couramment utilis et lisible par machine ?\nSi transfert directement  un autre responsable de traitement, le transfert est-il accept par ce dernier ?\nDans le cas d\'un traitement automatique, si la personne concerne exerce son droit  la portabilit des donnes, y a-t-il un arrangement pour que les donnes transitent directement vers le nouveau responsable du traitement.\n(Art 20)','What data format is expected?\nStructured? Commonly used and machine readable?\nIf transferred directly to another controller, is the transfer accepted by the controller?\nIn the case of automatic processing, if the data subject exercises his right to data portability, is there an arrangement for the data to pass directly to the new data controller?\n(Art. 20)','Welches Datenformat wird erwartet?\nStrukturiert? Gngig und maschinenlesbar?\nWird die bertragung bei einer direkten bertragung an einen anderen Verantwortlichen vom Verantwortlichen akzeptiert?\nExistiert im Falle der automatischen Verarbeitung, sofern ein Betroffener sein Recht auf Datenbertragbarkeit ausbt, eine Regelung, damit die Daten direkt ber den neuen Datenverantwortlichen laufen?\n(Art. 20)','Welk gegevensformaat werd voorzien? \nGestructureerd? Gangbare en machineleesbare vorm?\nIn geval van een overdracht aan een andere verwerkingsverantwoordelijke, wordt de overdracht dan aanvaard door die laatste?\nIs er in geval van een automatische verwerking sprake van de regeling volgens welke de gegevens rechtstreeks worden overgedragen naar de nieuwe verwerkingsverantwoordelijke, als de betrokken persoon zijn recht op de overdraagbaarheid van gegevens uitoefent?\n(art. 20)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(49,'49','Absence de DPO, alors qu\'il est requis par la loi','Absence of DPO, when required by law','Fehlen eines gesetzlich vorgeschriebenen DSB','Er is geen FGB, terwijl het wettelijk vereist is','Le responsable du traitement et le sous-traitant dsignent en tout tat de cause un dlgu  la protection des donnes lorsque:\na) le traitement est effectu par une autorit publique ou un organisme public,  l\'exception des juridictions agissant dans l\'exercice de leur fonction juridictionnelle;\nb) les activits de base du responsable du traitement ou du sous-traitant consistent en des oprations de traitement qui, du fait de leur nature, de leur porte et/ou de leurs finalits, exigent un suivi rgulier et systmatique  grande chelle des personnes concernes; ou\nc) les activits de base du responsable du traitement ou du sous-traitant consistent en un traitement  grande chelle de catgories particulires de donnes vises  l\'article 9 et de donnes  caractre personnel relatives  des condamnations pnales et  des infractions vises  l\'article 10.\n(Art 37.1)','The controller and the processor shall in any event designate a data protection officer when:\na) the processing is carried out by a public authority or body, except for courts acting in their judicial capacity\nb) the core activities of the controller or the processor consist of processing operations which, by virtue of their nature, their scope and/or their purposes, require regular and systematic monitoring of data subjects on a large scale\nc) the core activities of the controller or the processor consist of processing on a large scale of special categories of data pursuant to article 9 and personal data relating to criminal convictions and offences referred to in Article 10\n(Art. 37.1)','Der Verantwortliche und der Auftragsverarbeiter mssen auf jeden Fall einen Datenschutzbeauftragten benennen, wenn:\na) die Verarbeitung durch eine ffentliche Behrde oder Krperschaft erfolgt, mit Ausnahme von im Rahmen des Justizapparats handelnden Gerichten\nb) die Kernaktivitten des Verantwortlichen oder des Auftragsverarbeiters aus Verarbeitungsvorgngen bestehen, die aufgrund ihrer Art, ihres Umfangs und/oder ihrer Zwecke eine regelmige und systematische berwachung in groem Umfang von Datensubjekten erfordern\nc) die Kernaktivitten des Verantwortlichen und des Auftragsverarbeiters aus der gro angelegten Verarbeitung spezieller Datenkategorien gem Artikel 9 und personenbezogener Daten im Hinblick auf in Artikel 10 genannten strafrechtlichen Verurteilungen und Vergehen besteht\n(Art. 37.1)','De verwerkingsverantwoordelijke en de onderaannemer wijzen een functionaris voor gegevensbescherming aan in elk geval waarin:\na) de verwerking wordt verricht door een overheidsinstantie of overheidsorgaan, behalve in het geval van gerechten bij de uitoefening van hun rechterlijke taken;\nb) een verwerkingsverantwoordelijke of de onderaannemer hoofdzakelijk is belast met verwerkingen die vanwege hun aard, hun omvang en/of hun doeleinden regelmatige en stelselmatige observatie op grote schaal van betrokkenen vereisen; of\nc) de verwerkingsverantwoordelijke of de onderaannemer hoofdzakelijk is belast met grootschalige verwerking van bijzondere categorien van gegevens uit hoofde van artikel 9 en van persoonsgegevens met betrekking tot strafrechtelijke veroordelingen en strafbare feiten zoals bedoeld in artikel 10.\n(art. 37.1)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(50,'50','Le DPO n\'est pas joignable','The DPO is not reachable','DSB ist nicht erreichbar.','De FGB is niet bereikbaar','Utilisation excessive de la mutualisation ?\nLes lieux de travail sont trop loigns ?\nLes organismes sont trop volumineux ?\nLe DPO est en surcharge de travail ?\n(Art 37.2, 37.3, 37.4)','Excessive use of pooling?\nAre workplaces too far apart?\nAre the organisms too large?\nThe DPO is overworked?\n(Art. 37.2, 37.3, 37.4)','Exzessives Pooling?\nSind Arbeitspltze zu weit voneinander entfernt?\nSind die Organismen zu gro?\nIst der DSB berarbeitet?\n(Art. 37.2, 37.3 und 37.4)','Excessief gebruik van verdeling onder elkaar?\nZijn de werkplekken te ver van elkaar verwijderd?\nZijn de organismen te volumineus?\nHeeft de FGB een te grote werklast?\n(art. 37.2, 37.3, 37.4)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(51,'51','Mauvaise coopration avec le responsable du traitement','Poor cooperation with the controller','Schlechte Zusammenarbeit mit dem Verantwortlichen','Slechte samenwerking met de verwerkingsverantwoordelijke','Il aide le responsable du traitement   garantir le niveau de protection des donnes ?\nIl rpond aux demandes des personnes concernes qui le saisissent en vue d\'exercer leurs droits prvus ?\nIl rpond aux demandes du responsable de traitement (sur demande d\'exercice des droits de la personne concerne) ?\nIl met  la disposition du responsable du traitement toutes les informations ncessaires pour dmontrer le respect de ses obligations ?\n(Art 28.3)','Help the controller to ensure the level of data protection?\nResponds to requests from data subjects who seize it for the exercise of their intended rights?\nResponds to the requests of the controller (upon request of exercise of the rights of the person concerned)?\nProvides the controller with all the information necessary to demonstrate compliance with its obligations?\n(Art 28.3)','Untersttzung des Verantwortlichen beim Sicherstellen des Datenschutzniveaus?\nReagiert auf Antrge von Betroffenen, die sie zur Ausbung ihrer vorgesehenen Rechte nutzen?\nReagiert auf Antrge des Verantwortlichen (auf Verlangen der Ausbung der Rechte einer betroffenen Person)?\nVersorgt den Verantwortlichen mit allen zum Nachweis der Erfllung der Verpflichtungen erforderlichen Informationen?\n(Art. 28.3)','Helpt hij de verwerkingsverantwoordelijke het gegevensbeschermingsniveau te handhaven?\nBeantwoordt hij de verzoeken van betrokken personen die zich tot hem wenden met het oog op de uitoefening van hun voorziene rechten?\nBeantwoordt hij de verzoeken van de verwerkingsverantwoordelijke (op een verzoek om de uitoefening van rechten van de betrokken persoon) ?\nBezorgt hij de verwerkingsverantwoordelijke al de nodige informatie om de naleving van zijn verplichtingen aan te tonen?\n(art. 28.3)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(53,'52','Mauvaises conditions de sous-traitance en cascade','Poor subcontracting conditions in cascade','Schlechte Untervergabebedingungen in Kaskade','Gebrekkige omstandigheden voor meervoudige onderaanneming','Lorsqu\'un sous-traitant recrute un autre sous-traitant pour mener des activits de traitement spcifiques pour le compte du responsable du traitement, les mmes obligations en matire de protection de donnes que celles fixes dans le contrat ou un autre acte juridique entre le responsable du traitement et le sous-traitant.\n(Art 28, 29)','Where a processor recruits another processor to carry out specific processing activities on behalf of the controller, the same data protection obligations as those set out in the contract or other legal act between the controller of the processing and the processor.\n(Art 28,29)','Wirbt ein Auftragsverarbeiter einen anderen Auftragsverarbeiter zur Durchfhrung spezifischer Verarbeitungsaktivitten im Namen des Verantwortlichen an, gelten die gleichen Datenschutzverpflichtungen wie die im Vertrag oder einem anderen Rechtsgeschft zwischen dem Verantwortlichen der Verarbeitung und dem Auftragsverarbeiter festgelegten.\n(Art. 28 und 29)','Wanneer een onderaannemer een andere onderaannemer in dienst neemt voor de verrichting van specifieke verwerkingsactiviteiten voor rekening van de verwerkingsverantwoordelijke, gelden dezelfde verplichtingen inzake gegevensbescherming als die bepaald in het contract of een andere rechtshandeling tussen de verwerkingsverantwoordelijke en de onderaannemer.\n(art. 28, 29)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(54,'53','Absence de clauses pour les transferts vers des pays tiers n\'assurant pas le niveau de protection adquate','Lack of clauses for transfers to third countries not providing the appropriate level of protection','Fehlende Klauseln fr bertragungen in Drittlnder ohne geeignetes Schutzniveau','Gebrek aan clausules voor de doorgiften naar derde landen die een passende waarborg garanderen','Prsence de rgles d\'entreprise contraignantes ?\nPrsence d\'instruments juridiquement contraignants et excutoire\nPrsence d\'un code de conduite approuv conformment  l\'article 40\nPrsence de mcanismes de certification approuvs conformment  l\'article 42\n(Art 46)','Presence of binding corporate rules?\nPresence of legally binding and enforceable instruments\nPresence of a code of conduct approved in accordance with section 40\nPresence of certification mechanisms approved in accordance with Article 42\n(Art. 46)','Existenz verbindlicher interner Datenschutzvorschriften?\nExistenz rechtsverbindlicher und vollstreckungsfhiger Instrumente\nExistenz eines in bereinstimmung mit Abschnitt 40 genehmigten Verhaltenskodex\nExistenz von in bereinstimmung mit Artikel 42 genehmigten Zertifizierungsmechanismen\n(Art. 46)','Bestaan er bindende bedrijfsvoorschriften?\nBestaan er juridisch bindende en afdwingbare instrumenten?\nBestaat er een goedgekeurde gedragscode overeenkomstig artikel 40?\nBestaan er goedgekeurde certificeringsmechanismen overeenkomstig artikel 42?\n(art. 46)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(56,'54','Le traitement est illicite pour une autre finalit','Treatment is unlawful for another purpose','Behandlung ist fr einen anderen Zweck unrechtmig.','De verwerking is onrechtmatig voor een ander doeleinde','Si la condition de licit est remplie par les alinas b,d et f de l\'article 6.1. est-ce que la finalit tient compte, entre autres :\na) de l\'existence ventuelle d\'un lien entre les finalits \nb) du contexte dans lequel les donnes  caractre personnel ont t collectes\nc) de la nature des donnes  caractre personnel\nd) des consquences possibles du traitement ultrieur envisag pour les personnes concernes; \ne) de l\'existence de garanties appropries, qui peuvent comprendre le chiffrement ou la pseudonymisation.\n(Art 6.4)','If the condition of lawfulness is met by subparagraphs (b), (d) and (f) of Article 6.1. Does the purpose include, inter alia:\na) the existence link between the purposes for which the personal data have been collected and the purposes of the intended further processing\nb) the context in which the personal data have been collected\nc) the nature of the personal data\nd) the possible consequences of the intended further processing for data subjects\ne) the existence of appropriate safeguards, which may include encryption or pseudonymisation\n(Art. 6.4)','Wenn die Bedingung der Rechtmigkeit nach Unterparagrafen (b), (d) und (f) des Artikels 6.1 gegeben ist Beinhaltet der Zweck unter anderem:\na) die bestehende Verbindung zwischen den Zwecken, fr welche die personenbezogenen Daten erhoben wurden, und den Zwecken der beabsichtigten weiteren Verarbeitung\nb) den Kontext, in dem die personenbezogenen Daten erhoben wurden\nc) die Art der personenbezogenen Daten\nd) die mglichen Folgen der beabsichtigten weiteren Verarbeitung fr Betroffene\ne) die Existenz geeigneter Garantien, wie z.B. Verschlsselung oder Pseudonymisierung\n(Art. 6.4)','Als de rechtmatigheidsvoorwaarde wordt vervuld door de alineas b, d en f van artikel 6.1. houdt het doeleinde dan rekening met onder meer:\na) het eventuele bestaan van een verband tussen de doeleinden\nb) de context waarin de persoonsgegevens werden verzameld\nc) de aard van de persoonsgegevens\nd) de mogelijke gevolgen van de beoogde verdere verwerking voor de betrokken personen \ne) het bestaan van passende waarborgen, waaronder eventueel versleuteling of pseudonimisering.\n(art. 6.4)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(58,'55','Sous estimation des catgories de donnes traites','Underestimated categories of data processed','Unterschtzte Kategorien verarbeiteter Daten','Onderschatting van de verwerkte gegevenscategorien','Quels sont les types de donnes traites ?\nSauf exception le traitement des catgories de donnes suivantes est interdit :\n  - origine raciale ou ethnique,\n  - les opinions politiques,\n  - les convictions religieuses ou philosophiques\n  - l\'appartenance syndicale,\n  - les donnes gntiques, biomtriques aux fins d\'identifier une personne physique\n  - les donnes de sant ou des donnes\n  - Les donnes concernant la vie sexuelle ou l\'orientation sexuelle d\'une personne physique\nautres cas : donnes  caractre personnel relatives aux condamnations pnales et aux infractions\n(Art 9)(Art 10)','What types of data are processed?\nUnless otherwise specified, the following data categories are prohibited:\n   - racial or ethnic origin,\n   - political opinions,\n   - religious or philosophical convictions\n   - membership of trade unions,\n   - genetic and biometric data for the purpose of identifying a natural person\n   - health data or data\n   - Data concerning the sexual life or sexual orientation of a natural person\nother cases: personal data relating to criminal convictions and offences\n(Art. 9) (Art. 10)','Welche Arten von Daten werden verarbeitet?\nSofern nichts anderes festgelegt ist, sind folgende Datenkategorien unzulssig:\n   - ethnische Herkunft oder Rasse,\n   - politische Einstellungen,\n   - religise oder philosophische berzeugungen\n   - Mitgliedschaft in Gewerkschaften\n   - genetische und biometrische Daten zur Identifikation einer natrlichen Person\n   - Gesundheitsdaten oder\n   - Daten in Bezug auf das Sexualleben oder die sexuelle Orientierung einer natrlichen Person\nandere Flle: personenbezogene Daten im Hinblick auf strafrechtliche Verurteilungen und Vergehen\n(Art. 9) (Art. 10)','Wat zijn de verwerkte gegevenstypes?\nBehoudens uitzondering is de verwerking van de volgende gegevenscategorien verboden:\n  - ras of etnische herkomst,\n  - politieke opvattingen,\n  - religieuze of filosofische overtuigingen\n  - lidmaatschap van een vakbond,\n  - genetische of biometrische gegevens met het oog op de unieke identificatie van een persoon\n  - gegevens over gezondheid\n  - gegevens met betrekking tot het seksuele gedrag of de seksuele geaardheid van een natuurlijke persoon\nandere gevallen: persoonsgegevens met betrekking tot strafrechtelijke veroordelingen of inbreuken\n(art. 9)(art. 10)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(60,'56','La possibilit d\'utiliser des techniques de chiffrage ou de pseudonymisation n\'a pas t envisage','The possibility of using encryption or pseudonymization techniques was not envisaged','Die Verwendungsmglichkeit von Verschlsselungs- oder Pseudonymisierungstechniken war nicht vorgesehen.','De mogelijkheid om gebruik te maken van coderings- of pseudonimiseringstechnieken werd niet overwogen',NULL,NULL,NULL,NULL,NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(61,'57','Lors de la phase de conception des nouveaux projets, la protection des donnes par dfaut n\'est pas prise en compte','During the design phase of new projects, data protection by design and by default are not taken into account','In der Entwurfsphase neuer Projekte wird beabsichtigter und standardmiger Datenschutz nicht bercksichtigt.','Tijdens de ontwerpfase van nieuwe projecten wordt de gegevensbescherming door standaardinstellingen niet in aanmerking genomen','Lors des premires phases de la conception d\'un nouveau traitement est-ce que la scurit des donnes est prise en considration ?\nEst-ce que la conformit au GDPR est prise en considration ? \n(Art 25)','In the early stages of designing a new processing, is data security taken into consideration?\nIs compliance with the GDPR taken into consideration?\n(Art. 25)','Wird in der frhen Phase der Entwicklung neuer Prozesse das Thema Datensicherheit bercksichtigt?\nWird das Thema DSGVO-Compliance bercksichtigt?\n(Art.25)','Wordt er tijdens de eerste fasen van het ontwerp van een nieuwe verwerking rekening gehouden met de gegevensbeveiliging?\nWordt de conformiteit met de AVG in aanmerking genomen? \n(art. 25)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(62,'58','Dans le cas d\'une responsabilit conjointe du traitement, les responsabilits ne sont pas clairement dfinies','In the case of joint responsibility for processing, responsibilities are not clearly defined','Im Fall einer gemeinsamen Zustndigkeit fr die Verarbeitung sind die einzelnen Zustndigkeiten nicht klar definiert.','In geval van een gezamenlijke verwerkingsverantwoordelijkheid worden de verantwoordelijkheden niet duidelijk gedefinieerd','Les obligations respectives sont-elles clairement dfinies ? Formelles ?\nLa personne concerne est-elle informe des accords entre co-responsables (au moins dans les grandes lignes) ?\nSait-elle sans ambigit comment et  qui elle doit s\'adresser pour jouir de tous ses droits ?\n(Art 26)','Are the respective obligations clearly defined? Formal?\nIs the data subject informed of agreements between co-officials (at least in broad terms)?\nDoes he know unambiguously how and to whom he must address himself to enjoy all his rights?\n(Art. 26)','Wurden die entsprechenden Verpflichtungen klar definiert? Formal?\nWurde die betroffene Person (Datensubjekt) ber Vereinbarungen mit anderen offiziellen Stellen (zumindest in groben Zgen) informiert?\nWei er/sie eindeutig, wie und bei wem er/sie sich mel','Worden de respectieve verplichtingen duidelijk gedefinieerd? Formeel?\nWordt de betrokken persoon op de hoogte gebracht van de akkoorden tussen de gezamenlijke verantwoordelijken (minstens in grote lijnen)?\nWeet hij of zij perfect hoe en tot wie zich te richten om te genieten van al zijn of haar rechten?\n(art. 26)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(63,'59','Les reprsentants des responsables du traitement ou des sous-traitants ne sont pas tablis dans l\'Union','Representatives of the controllers or processors are not established in the Union','Vertreter der Verantwortlichen oder Auftragsverarbeiter sind nicht in der Union ansssig.','De vertegenwoordigers van de verwerkingsverantwoordelijken of de onderaannemer zijn niet gevestigd in de Unie','Le responsable du traitement ou le sous-traitant a-t-il dsign par crit un reprsentant dans l\'Union ?\nVoir GDPR pour les exceptions.\n(Art 27)','Has the controller or processor appointed a representative in a formal way?\nSee GDPR for exceptions.\n(Art. 27)','Hat der Verantwortliche oder Auftragsverarbeiter formell einen Vertreter ernannt?\nSiehe DSGVO fr Ausnahmen.\n(Art.27)','Heeft de verwerkingsverantwoordelijke of de onderaannemer schriftelijk een vertegenwoordiger in de Unie benoemd?\nZie AVG voor de uitzonderingen.\n(art. 27)',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(119,'RO_004','Les processus ne sont pas documents ou mis  jour','Processes are not documented or updated','Prozesse werden nicht dokumentiert oder aktualisiert.','De processen worden niet gedocumenteerd of bijgewerkt','Distribution, accs, rcupration et utilisation;\nStockage et protection, y compris prservation de la lisibilit;\nMatrise des modifications (par exemple, contrle des versions);\nConservation et limination.','Distribution, Access, Recovery and Use;\nStorage and protection, including preservation of legibility;\nControl of changes (eg version control);\nStorage and disposal.','Verbreitung, Zugang, Recovery und Nutzung;\nSpeicherung und Schutz, einschlielich Erhaltung der Lesbarkeit;\nnderungsverfolgung (z.B. Versionskontrolle);\nSpeicherung und Lschung.','Distributie, toegang, recuperatie en gebruik;\nOpslag en beveiliging, inclusief behoud van de leesbaarheid;\nBeheersing van de wijzigingen (bijvoorbeeld, controle van de versies);\nBewaring en verwijdering.',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(120,'RO_005','Les exigences lgales et rglementaires applicables ne sont pas dtermines, comprises et satisfaites en permanence','The applicable legal and regulatory requirements are not determined, understood and consistently met','Die anwendbaren gesetzlichen und aufsichtsrechtlichen Verpflichtungen sind unbestimmt, unverstanden und werden nicht konsequent erfllt.','De geldende wettelijke voorschriften worden niet permanent bepaald, begrepen en nageleefd','Conformit des produits\nContrat avec le client','Product Compliance\nCustomer agreement','Produkt-Compliance\nKundenvertrag','Conformiteit van de producten\nContract met de klant',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(121,'RO_006','Absence de planification de ressources ncessaires a mise en oeuvre et  la matrise du processus.','Lack of resource planning required to implement and control the process.','Fehlende Planung von zur Implementierung und Kontrolle des Prozesses erforderlichen Ressourcen','Gebrek aan een planning van de vereiste middelen voor de implementatie en de beheersing van het proces.','Ressources humaines\nInfrastructure\nLes btiments et les services associs\nLes quipements, y compris matriel et logiciel\nles moyens de transport\nLes technologies de linformation et de la communication.','Human ressources\nInfrastructure\n Buildings and associated services\n Equipment, including hardware and software\nmethods of transportation\nInformation and communication technologies.','Personalwesen\nInfrastruktur\nGebude und relevante Services\nAusstattung, einschlielich Hardware und Software\nTransportmethoden\nInformations- und Kommunikationstechnologien.','Human resources\nInfrastructuur\nBijbehorende gebouwen en diensten\nUitrustingen, inclusief hardware en software\nTransportmiddelen\nInformatie- en communicatietechnologien.',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(122,'RO_007','Absence d\'un moyen de  retour dinformation des clients concernant les produits et services, y compris leurs rclamations','Lack of feedback from customers regarding products and services, including their claims','Fehlendes Feedback von Kunden ber Produkte und Dienstleistungen, einschlielich ihrer Forderungen','Gebrek aan een mogelijkheid voor klanten om feedback te geven over producten en diensten, inclusief klachten','Questionnaire de satisfaction\nContact tlphonique','Feedback survey','Feedback-Umfrage','Tevredenheidsvragenlijst\nTelefonisch contact',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(123,'RO_008','Environnement inadquat pour la mise en oeuvre du processus','Inadequate environment for the implementation of the process','Unzureichende Umgebung fr die Implementierung des Prozesses','Ongeschikte omgeving voor de implementatie van het proces','Aspects sociaux (par exemple non discriminatoire, calme, non conflictuel);\nAspects psychologiques (par exemple rduction du stress, prvention du burnout, protection affective);\nAspects physiques (par exemple temprature, chaleur, humidit, lumire, circulation dair, hygine, bruit).','Social aspects (calm, non-discriminatory);\nPsycological aspects (reduction of stress, prevention of burnout, emotional protection);\nPhysical aspects (temperature, heat, humidity, light, air circulation, hygiene, noise).','Soziale Aspekte (ruhig, nicht diskriminierend);\nPsychologische Aspekte (Stressreduzierung, Burnout-Prophylaxe, emotionaler Schutz);\nPhysische Aspekte (Temperatur, Hitze, Feuchtigkeit, Licht, Luftzirkulation, Hygiene, Lrm).','Sociale aspecten (bijvoorbeeld niet-discriminerend, rustig, geen conflictsituaties);\nPsychologische aspecten (bijvoorbeeld stressvermindering, preventie van burn-out, bescherming van het gevoelsleven);\nFysieke aspecten (bijvoorbeeld temperatuur, luchtvochtigheid, licht, luchtcirculatie, hygine, geluid).',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(124,'RO_009','Le niveau de comptences des personnes n\'est pas appropri','People\'s skill level is not appropriate','Kenntnisstand der Menschen ist unzureichend.','Het bekwaamheidsniveau van de personen is niet aangepast','Formation initiale ou professionnelle\nConnaissances acquises par lexprience\nInformations documentes','Initial or professional training\nKnowledge gained through experience\nDocumented information','Erstausbildung oder Weiterbildung\nWissen durch Erfahrung\nDokumentierte Information','Aanvangs- of beroepsopleiding\nOpgedane kennis door ervaring\nGedocumenteerde informatie',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(125,'RO_010','Les prestataires externes compromettent la qualit du processus','External providers jeopardize the quality of the process','Externe Anbieter gefhrden die Qualitt des Prozesses.','De externe dienstverleners brengen de kwaliteit van het proces in het gedrang','Exigences lgales et rglementaires\nCommunication avec les prestataires externes\nSurveillance des performances des prestataires','Legal and Regulatory Requirements\nCommunication with external providers\nMonitoring provider performance','Rechtliche und regulatorische Anforderungen\nKommunikation mit externen Anbietern\nberwachung der Anbieter-Performance','Wettelijke verplichtingen en voorschriften\nCommunicatie met de externe dienstverleners\nToezicht op de prestaties van de dienstverleners',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00');
