ata','Prinzipien bezglich der Verarbeitung personenbezogener Daten','Principes i.v.m. de verwerking',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(19,'DPIA_Consent','Consentement','Consent','Einwilligung','Toestemming',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(20,'DPIA_Droitsacces','Droits d\'accs','Right to access','Recht auf Zugang','Toegangsrechten',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(21,'DPIA_Droitefface','Droit  l\'effacement','Right to erasure','Recht auf Lschung','Schrappingsrecht',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(22,'DPIA_TransUE','Transfert hors UE','Transfer outside EU','bertragung auerhalb EU','Doorgifte buiten EU',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00'),(24,'Qualit','Qualit','Quality','Qualitt','Kwaliteit',NULL,'1970-01-01 00:00:00',NULL,'1970-01-01 00:00:00');
