INSERT INTO `scales_comments` VALUES (814,31,61,NULL,2,2,'Vulnrabilit faible : Des mesures efficaces sont en place.\nBonne maturit : Les bonnes pratiques sont implmentes.','Weak vulnerability: Some efficient measures have been already taken.\nHigh maturity: Good practices are implemented.','Geringes Sicherheitsrisiko: Einige effiziente Manahmen wurden bereits getroffen.\nHoher Reifegrad: Bewhrte Verfahrensweisen sind implementiert.','Geringe kwetsbaarheid: er werden doeltreffende maatregelen genomen. De goede praktijken werden gemplementeerd.',NULL,'2017-01-19 12:37:42',NULL,NULL),(815,31,61,NULL,1,1,'Vulnrabilit trs faible : Des mesures efficaces sont en place, leurs efficacits sont contrles.\nTrs bonne maturit : Les bonnes pratiques sont implmentes et priodiquement vrifies.','Very weak vulnerability: Some efficient measures have been already taken, and their effectiveness is controlled.\nVery high maturity: Good practices are implemented and frequently verified.','Sehr geringes Sicherheitsrisiko: Einige effiziente Manahmen wurden bereits getroffen und ihre Effizienz wird kontrolliert.\nSehr hoher Reifegrad: Bewhrte Verfahrensweisen sind implementiert und werden hufig berprft.','Zeer geringe kwetsbaarheid: er werden doeltreffende maatregelen genomen. De goede praktijken werden gemplementeerd en worden regelmatig geverifieerd.',NULL,'2017-01-19 12:37:44',NULL,NULL),(816,31,62,NULL,4,4,'Trs probable facile  mettre en uvre, pas d\'investissement ou d\'expertise particulire.','Very likely: easy to execute, no mentionable investment or knowledge necessary','Sehr wahrscheinlich: einfach auszufhren, keine nennenswerte Investitionen oder Kenntnisse erforderlich','Zeer waarschijnlijk: gemakkelijk te implementeren, geen investering of specifieke expertise',NULL,'2017-01-19 12:37:45',NULL,NULL),(817,31,61,NULL,0,0,'Pas de vulnrabilit','No vulnerabilities.','Keine Sicherheitsrisiken','Geen kwetsbaarheid',NULL,'2017-01-19 12:37:46',NULL,NULL),(818,31,62,NULL,3,3,'Peut arriver de temps  autre.','Could happen occasionally','Knnte gelegentlich auftreten','Kan nu en dan voorkomen',NULL,'2017-01-19 12:37:48',NULL,NULL),(819,31,62,NULL,1,1,'Trs improbable : jamais arriv, ncessite d\'un haut niveau d\'expertise, ou trs coteux  mettre en uvre.','Very unlikely: never happened, requires a high level of expert knowledge, or it is very expensive to execute.','Sehr unwahrscheinlich: nie aufgetreten, erfordert ein hohes Niveau an Fachwissen oder ist kostspielig bei der Ausfhrung','Zeer onwaarschijnlijk: nooit voorgekomen, vereist een hoog expertiseniveau, of zeer kostelijk om te implementeren.',NULL,'2017-01-19 12:37:49',NULL,NULL),(820,31,62,NULL,2,2,'Improbable : Peut tre dj survenu, phnomne rare ou ncessite d\'un bon niveau d\'expertise ou coteux  mettre en uvre.','Unlikely: might have happened, rare phenomenon which requires a good level of expert knowledge, or it is expensive to execute.','Unwahrscheinlich: htte auftreten knnen, seltenes Phnomen, das ein gutes Niveau an Fachwissen erfordert oder kostspielig bei der Ausfhrung ist','Onwaarschijnlijk: kan al ooit zijn voorgekomen, zeldzaam verschijnsel of vereist een goed expertiseniveau of kostelijk om te implementeren.',NULL,'2017-01-19 12:37:50',NULL,NULL),(821,31,62,NULL,0,0,'Impossible','Impossible','Unmglich','Onmogelijk',NULL,'2017-01-19 12:37:51',NULL,NULL),(822,31,63,161,4,4,'Impact trs srieux, insupportable\nLa divulgation nuit de faon quasi insurmontable aux intrts de lorganisation.\nExemples :\n- Divulgation dinformation secrte ou trs sensible\n- Information classifie par la loi (EU, OTAN, nationale, etc.)','Really strong impact, unbearable.\nInformation leaks almost deadly harm organizations interest.\nExample: \n- Secret or really sensitive information leaks.\n- Classified information by the law (the EU, NATO, national)','uerst starke Auswirkung, untragbar\nInformationslecks ruinieren die Interessen der Organisation beinahe.\nBeispiel: \n- Geheime oder hchst vertrauliche Informationen werden preisgegeben.\n- Geheimsachen nach Gesetz (EU, NATO, National)','Zeer ernstig effect, ondraaglijk\nDe verspreiding brengt praktisch onherstelbare schade toe aan de belangen van de organisatie.\nVoorbeelden:\n- verspreiding van geheime of zeer gevoelige informatie\n- door de wet geclassificeerde informatie (EU, NAVO, nationaalenz.)',NULL,'2017-01-19 12:37:53',NULL,NULL),(823,31,63,161,3,3,'Impact srieux, difficilement supportable\nLa divulgation nuit gravement aux intrts de lorganisation\nExemples :\n- Divulgation dinformation confidentielle\n- Secret bancaire\n- Donnes  caractre personnelles sensibles\n- Incidents de scurit','Strong impact, hardly bearable.\nInformation leaks seriously harm organizations interest. Example: \n- Confidential information leaks. \n- Bank secrecy\n- Sensitive personal data\n- Security incident','Starke Auswirkung, kaum tragbar\nInformationslecks schdigen die Interessen der Organisation erheblich. Beispiel: \n- Vertrauliche Informationen werden preisgegeben. \n- Bankgeheimnis\n- Vertrauliche personenbezogene Daten\n- Sicherheitsvorfall','Ernstig effect, praktisch ondraaglijk\nDe verspreiding brengt de belangen van de organisatie ernstige schade toe\nVoorbeelden:\n- verspreiding van vertrouwelijke informatie\n- bankgeheim\n- gevoelige persoonlijke gegevens\n- veiligheidsincidenten',NULL,'2017-01-19 12:37:54',NULL,NULL),(824,31,63,161,2,2,'Impact moyen, acceptable\nLa divulgation nuit aux intrts de lorganisation\nExemples :\n- Divulgation dinformation moyennement sensible restreinte  un groupe de personnes\n- schma de rseau interne\n- Documentation ou programme source non critique','Average impact, acceptable.\nInformation leaks harm organizations interests.\nExamples:\n- Moderately sensitive information leaks which are only for a group of people.\n- Internal networking scheme.\n- Documentation or source code which is non-critical.','Durchschnittliche Auswirkung, annehmbar\nInformationslecks schdigen die Interessen der Organisation.\nBeispiele:\n- Mig vertrauliche Information, die nur eine Personengruppe betreffen, werden preisgegeben.\n- Schema fr internes Networking\n- Dokumentation ','Gemiddeld effect, aanvaardbaar\nDe verspreiding brengt de belangen van de organisatie schade toe\nVoorbeelden:\n- verspreiding van gemiddeld gevoelige informatie beperkt tot een groep van personen\n- schema van intern netwerk\n- niet kritiek(e) documentatie of bronprogramma',NULL,'2017-01-19 12:37:55',NULL,NULL),(839,31,63,161,1,1,'Impact faible, ngligeable\nLa divulgation est dfavorable aux intrts de lorganisation\nExemples : \n- Divulgation dinformation interne ne devant pas sortir de lorganisme\n- Note de service\n- Annuaire tlphonique interne','Weak impact, insignificant. \nInformation leaks are negative to the organizations interests.\nExamples:\n- Internal information leaks which shouldnt be outside the company.\n- Memorandum\n- Internal phone directory','Schwache Auswirkung, unbedeutend \nInformationslecks sind negativ fr die Interessen der Organisation.\nBeispiele:\n- Interne Informationen, die das Unternehmen nicht verlassen sollten, werden preisgegeben.\n- Memos\n- Internes Telefonverzeichnis','Gering effect, verwaarloosbaar\nDe verspreiding is ongunstig voor de belangen van de organisatie\nVoorbeelden: \n- verspreiding van interne informatie die het organisme niet mag verlaten\n- dienstnota\n- intern telefoonboek',NULL,'2017-01-19 12:38:14',NULL,NULL),(840,31,63,166,2,2,'Condamnation possible de lorganisme','Possible sentence for the company.','Mgliche Strafe fr die Firma','Mogelijke veroordeling van het organisme',NULL,'2017-01-19 12:38:15',NULL,NULL),(843,31,63,161,0,0,'Impact inexistant. \nLe critre de confidentialit nest pas important','Nonexistent impact.\nThe confidentiality criterion is not important.','Ohne Auswirkung\nDas Vertraulichkeitskriterium ist nicht wichtig.','Geen effect. \nHet vertrouwelijkheidscriterium is niet belangrijk.',NULL,'2017-01-19 12:38:19',NULL,NULL),(848,31,61,NULL,4,4,'Vulnrabilit leve : Des mesures sont en place, mais elles sont peu efficaces ou inadaptes.\nMaturit faible : Les bonnes pratiques ne sont pas implmentes, pratiques primaires sans rflexion.','Strong vulnerability: Some measures have been already taken, even though they are ineffective or unadapted.\nLow maturity: Good practices arent implemented, but there are some positive reactions without any thoughts.','Hohes Sicherheitsrisiko: Einige Manahmen wurden bereits ergriffen, sind jedoch ineffizient oder ungeeignet.\nNiedriger Reifegrad: Bewhrte Verfahrensweisen sind nicht implementiert, aber es gibt einige positive unberlegt Reaktionen.','Hoge kwetsbaarheid: er zijn maatregelen getroffen, maar die zijn niet bijzonder efficint of onaangepast.',NULL,'2017-01-19 12:38:25',NULL,NULL),(849,31,61,NULL,5,5,'Vulnrabilit trs leve : aucune mesure en place.\nMaturit trs faible - Aucune maturit.','Very strong vulnerability: No measures have been implemented.\nVery low maturity or no maturity at all.','Sehr hohes Sicherheitsrisiko: Manahmen wurden nicht implementiert.\nSehr niedriger Reifegrad oder vllig fehlender Reifegrad','Zeer hoge kwetsbaarheid: geen maatregelen getroffen.',NULL,'2017-01-19 12:38:26',NULL,NULL),(855,31,61,NULL,3,3,'Vulnrabilit normale : Des mesures sont en place, elle peuvent encore tre amliores.\nMaturit moyenne : Les bonnes pratiques sont implmentes sans recherche d\'amlioration.','Average vulnerability: Some measures have been already taken, even though they could be better.\nAverage maturity: Good practices are implemented without searching a better way.','Durchschnittliches Sicherheitsrisiko: Einige Manahmen wurden bereits ergriffen, knnten jedoch besser sein.\nDurchschnittlicher Reifegrad: Bewhrte Verfahrensweisen sind implementiert ohne Suche nach einem besseren Weg.','Normale kwetsbaarheid: er zijn maatregelen getroffen, en die werken zonder dat er naar verbetering wordt gestreefd.',NULL,'2017-01-19 12:38:34',NULL,NULL),(884,31,63,165,3,3,'Interruption d\'un service entier','Interruption of a whole department.','Strung einer gesamten Abteilung','Onderbreking van een volledige dienst',NULL,'2017-01-19 12:39:12',NULL,NULL),(887,31,63,162,4,4,'Impact trs srieux, insupportable\nCorruption non recouvrable dbouchant sur une indisponibilit dfinitive','Really strong impact, unbearable.\nCorruption which cant be recovered or bring a permanent downtime.','uerst starke Auswirkung, untragbar\nBeschdigung , die nicht wiederherstellbar ist oder zur permanenter Downtime fhrt','Zeer ernstig effect, ondraaglijk\nOnherstelbare aantasting die uitmondt in een definitieve onbeschikbaarheid',NULL,'2017-01-19 12:39:17',NULL,NULL),(888,31,63,163,4,4,'Impact trs srieux, insupportable\nIndisponibilit demandant un trs gros effort de rtablissement, voire dfinitif.\nExemples :\n- Large dpassement des dlais maximums considrs comme insupportables','Really strong impact, unbearable.\nUnavailability which asks some drastic efforts to recover, or even final.\nExample:\n- Important maximums time periods consider as unbearable.','uerst starke Auswirkung, untragbar\nNichtverfgbarkeit, die einige drastische Anstrengungen zur Wiederherstellung erfordert oder sogar endgltig ist\nBeispiel:\n- Substanzielle Hchstdauerphasen gelten als untragbar.','Zeer ernstig effect, ondraaglijk\nOnbeschikbaarheid die een zeer grote of zelfs definitieve herstelinspanning vergt.\nVoorbeelden:\n- ruime overschrijding van de als ondraaglijk beschouwde maximumtermijnen',NULL,'2017-01-19 12:39:18',NULL,NULL),(889,31,63,162,3,3,'Impact trs srieux, insupportable\nCorruption non recouvrable dbouchant sur une indisponibilit dfinitive','Strong impact, hardly bearable.\nCorruption which brings a considerable inconvenience to the stakeholders. \nExample: \n- Confusion between stakeholders.','Starke Auswirkung, kaum tragbar\nBeschdigung, die zu erheblichen Unannehmlichkeiten fr die Stakeholder fhrt \nBeispiel: \n- Verwirrung unter Stakeholdern','Zeer ernstig effect, ondraaglijk\nOnherstelbare aantasting die uitmondt in een definitieve onbeschikbaarheid',NULL,'2017-01-19 12:39:20',NULL,NULL),(890,31,63,165,4,4,'Arrt total de tous les services','Complete stop of all services','Vlliger Stillstand aller Dienste','Totale stopzetting van alle diensten',NULL,'2017-01-19 12:39:21',NULL,NULL),(891,31,63,166,4,4,'Condamnation lourde de l\'organisme.','Heavy sentence for the company.','Schwere Strafe fr die Firma','Ernstige veroordeling van het organisme.',NULL,'2017-01-19 12:39:22',NULL,NULL),(892,31,63,163,3,3,'Impact srieux, difficilement supportable \nIndisponibilit occasionnant une gne considrable aux parties prenantes.\nExemples :\n- Atteinte des dlais maximums considrs comme insupportables','Strong impact, hardly bearable.\nUnavailability which bring a considerable inconvinience to the stakeholders. \nExample: \n- Maximum time periods consider as unbearable are reached.','Starke Auswirkung, kaum tragbar\nNichtverfgbarkeit, die zu erheblichen Unannehmlichkeiten fr die Stakeholder fhrt \nBeispiel: \n- Als untragbar geltende Hchstdauerphasen werden erreicht.','Ernstig effect, praktisch ondraaglijk\nOnbeschikbaarheid die een aanzienlijke hinder vormt voor de ontvangende partijen.\nVoorbeelden:\n- bereiken van de als ondraaglijk beschouwde maximumtermijnen',NULL,'2017-01-19 12:39:24',NULL,NULL),(893,31,63,164,4,4,'Mort dhomme. \nAltration dfinitive de limage de lorganisme ou de ses reprsentants.\nCouverture mdiatique internationale.','Death of someone.\nDefinitive degradation of the company or staff reputation. \nInternationnal media coverage.','Tod einer Person\nDefinitive Abwertung der Firma oder des Rufs der Belegschaft \nInternationale Berichterstattung','Sterfgeval. \nDefinitieve aantasting van het imago van het organisme of van zijn vertegenwoordigers.\nInternationale mediaberichtgeving.',NULL,'2017-01-19 12:39:25',NULL,NULL),(894,31,63,162,2,2,'Impact moyen, acceptable \nCorruption occasionnant une gne modre aux parties prenantes. Le rtablissement est facile.\nExemples :\n- Site Internet informationnel','Average impact, acceptable.\nCorruption which brings an inconvenience to the stakeholders. Recovery is easy.\nExample:\n- Informational web site.','Durchschnittliche Auswirkung, annehmbar\nBeschdigung, die zu Unannehmlichkeiten fr die Stakeholder fhrt Wiederherstellung ist einfach.\nBeispiel:\n- Informative Website','Gemiddeld effect, aanvaardbaar\nAantasting die een matige hinder vormt voor de ontvangende partijen. Eenvoudig te herstellen.\nVoorbeelden:\n- informatiewebsite',NULL,'2017-01-19 12:39:26',NULL,NULL),(895,31,63,163,2,2,'Impact moyen, acceptable \nIndisponibilit occasionnant une gne modre aux parties prenantes.\nExemples :\n- Dlais maximums considrs comme insupportables pas encore atteints','Average impact, acceptable.\nUnavailability which brings an inconvenience to the stakeholders. \nExample:\n- Maximum time periods consider as unbearable are not reached.','Durchschnittliche Auswirkung, annehmbar\nNichtverfgbarkeit, die zu Unannehmlichkeiten fr die Stakeholder fhrt \nBeispiel:\n- Als untragbar geltende Hchstdauerphasen werden nicht erreicht.','Gemiddeld effect, aanvaardbaar\nOnbeschikbaarheid die een matige hinder vormt voor de ontvangende partijen.\nVoorbeelden:\n- als ondraaglijk beschouwde maximumtermijnen nog niet bereikt',NULL,'2017-01-19 12:39:27',NULL,NULL),(896,31,63,164,3,3,'Trs forte altration de limage de lorganisme ou de ses reprsentants.\nCritique srieuse et rpte dans les mdias.','Strong degradation of the company or staff reputation.\nSerious and repeated media critics.','Starke Abwertung der Firma oder des Rufs der Belegschaft\nScharfe und wiederholte Kritik in den Medien','Zeer ernstige aantasting van het imago van het organisme of van zijn vertegenwoordigers.\nErnstige en herhaalde kritiek in de media.',NULL,'2017-01-19 12:39:29',NULL,NULL),(897,31,63,162,1,1,'Impact faible, ngligeable\nCorruption facile  rectifier et sans grandes consquences.\nExemples :\n- Courrier interne, e-mail interne','Weak impact, insignificant. Corruption easy to rectify without any consequences. \nExample: \n- Internal mail or letter.','Schwache Auswirkung, unbedeutend Einfach zu richtende Beschdigung ohne jegliche Folgen \nBeispiel: \n- Interne E-Mail oder Schreiben','Gering effect, verwaarloosbaar\nGemakkelijk te herstellen aantasting zonder grote gevolgen.\nVoorbeelden:\n- interne post, interne e-mail',NULL,'2017-01-19 12:39:30',NULL,NULL),(898,31,63,165,2,2,'Incident isol avec impact grable sur la clientle','Isolated incidents with a manageable impact on customers.','Isolierte Vorflle mit berschaubarer Auswirkung auf Kunden','Gesoleerd incident met beheersbaar effect op de klanten',NULL,'2017-01-19 12:39:31',NULL,NULL),(899,31,63,163,1,1,'Impact faible, ngligeable\nIndisponibilit gnante, mais pas encore prjudiciable pour les parties prenantes','Weak impact, insignificant. \nUnavailability which is inconvenient, but not really harmful for the stakeholders.','Schwache Auswirkung, unbedeutend \nNichtverfgbarkeit, die umstndlich, aber nicht wirklich nachteilig fr die Stakeholder ist','Gering effect, verwaarloosbaar\nHinderlijke onbeschikbaarheid, maar nog niet schadelijk voor de ontvangende partijen',NULL,'2017-01-19 12:39:32',NULL,NULL),(900,31,63,164,2,2,'Altration passagre de limage de lorganisme ou de ses reprsentants.\nCritique occasionnelle dans les mdias.','Temporary degradation of the company or staff reputation.\nOccasional media critics','Vorbergehende Abwertung der Firma oder des Rufs der Belegschaft\nGelegentliche Kritik in den Medien','Tijdelijke wijziging van het imago van het organisme of van zijn vertegenwoordigers.\nOccasionele kritiek in de media.',NULL,'2017-01-19 12:39:34',NULL,NULL),(901,31,63,162,0,0,'Impact inexistant. \nLe critre dintgrit nest pas important.','Nonexistent impact.\nThe integrity criterion is not important.','Ohne Auswirkung\nDas Integrittskriterium ist nicht wichtig.','Geen effect. \nHet integriteitscriterium is niet belangrijk.',NULL,'2017-01-19 12:39:34',NULL,NULL),(902,31,63,163,0,0,'Impact inexistant. \nLe critre de disponibilit nest pas important','Nonexistent impact.\nThe availability criterion is not important.','Ohne Auswirkung\nDas Verfgbarkeitskriterium ist nicht wichtig.','Geen effect. \nHet beschikbaarheidscriterium is niet belangrijk.',NULL,'2017-01-19 12:39:36',NULL,NULL),(1043,31,63,164,0,0,'Pas d\'impact','No consequences','Keine Folgen','Geen effect',NULL,'2017-01-19 12:42:42',NULL,NULL),(1044,31,63,165,0,0,'Pas d\'impact','No consequences','Keine Folgen','Geen effect',NULL,'2017-01-19 12:42:43',NULL,NULL),(1045,31,63,166,0,0,'Pas d\'impact','No consequences','Keine Folgen','Geen effect',NULL,'2017-01-19 12:42:45',NULL,NULL),(1046,31,63,167,0,0,'Pas d\'impact','No consequences','Keine Folgen','Geen effect',NULL,'2017-01-19 12:42:46',NULL,NULL),(1047,31,63,168,0,0,'Pas d\'impact','No consequences','Keine Folgen','Geen effect',NULL,'2017-01-19 12:42:48',NULL,NULL),(1048,31,63,164,1,1,'Critique ponctuelle dans les mdias.','Sporadic media critics','Sporadische Kritik in den Medien','Plaatselijke kritiek in de media.',NULL,'2017-01-19 12:42:49',NULL,NULL),(1049,31,63,165,1,1,'Incident mineur sans impact sur la clientle','Minor incidents without any impact on customers.','Kleinere Vorflle ohne jegliche Auswirkungen fr Kunden','Incident van ondergeschikt belang met beheersbaar effect op de clientle',NULL,'2017-01-19 12:42:50',NULL,NULL),(1050,31,63,166,1,1,'Trs peu de chance quil y est condamnation, ou elle sera trs lgre. \nToute poursuite serait vaine.','Small probability of any sentences, or really slight one. \nAny prosecution should be futile.','Geringe Wahrscheinlichkeit einer Strafe oder nur einer sehr leichten \nJegliche Verfolgung sollte aussichtslos sein.','Zeer kleine kans op een veroordeling, of de veroordeling zal zeer licht zijn. \nIedere vervolging zou vergeefs zijn.',NULL,'2017-01-19 12:42:51',NULL,NULL),(1051,31,63,167,1,1,'Engage quelques frais ngligeabl