100,271,3,3,'Engage des frais considrables qui auront de rpercussions sur lorganisme. (+/- 10% CA)','Brings some heavy fees which can affect the company (more or less 10% of the sales revenue).','Fhrt zu einigen hohen Gebhren, welche die Firma beeintrchtigen knnen (um 10% der Verkaufserlse).','Veroorzaakt aanzienlijke kosten die repercussies zouden kunnen hebben op het organisme. (+/- 10% omzet)','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1202,44,100,272,3,3,'Consquences significatives qui devraient tre surmontes, mais avec de srieuses difficults (dtournement dargent, interdiction bancaire, dgradation de bien, perte demploi, assignation en justice, aggravation de sant, etc.)','Significative consequences which could be topped, but with some serious difficulties (funds embezzlement, bank ban, deterioration of goods, job loss.).','Erhebliche Folgen, die berwunden werden knnten, aber nur mit groer Mhe (Veruntreuung von Geldern, Bankverbot, Verschlechterung von Gtern, Arbeitsverlust)','Aanzienlijke gevolgen die men te boven zou kunnen komen, maar met ernstige moeilijkheden (verduistering van geld, bankverbod, beschadiging van goederen, verlies van werk, dagvaarding, aantasting van de gezondheidenz.)','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1203,44,100,265,4,4,'Impact trs srieux, insupportable\nLa divulgation nuit de faon quasi insurmontable aux intrts de lorganisation.\nExemples :\n- Divulgation dinformation secrte ou trs sensible\n- Information classifie par la loi (EU, OTAN, nationale, etc.)','Really strong impact, unbearable.\nInformation leaks almost deadly harm organizations interest.\nExample: \n- Secret or really sensitive information leaks.\n- Classified information by the law (the EU, NATO, national)','uerst starke Auswirkung, untragbar\nInformationslecks ruinieren die Interessen der Organisation beinahe.\nBeispiel: \n- Geheime oder hchst vertrauliche Informationen werden preisgegeben.\n- Geheimsachen nach Gesetz (EU, NATO, National)','Zeer ernstig effect, ondraaglijk\nDe verspreiding brengt praktisch onherstelbare schade toe aan de belangen van de organisatie.\nVoorbeelden:\n- verspreiding van geheime of zeer gevoelige informatie\n- door de wet geclassificeerde informatie (EU, NAVO, nationaalenz.)','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1204,44,100,266,4,4,'Impact trs srieux, insupportable\nCorruption non recouvrable dbouchant sur une indisponibilit dfinitive','Really strong impact, unbearable.\nCorruption which cant be recovered or bring a permanent downtime.','uerst starke Auswirkung, untragbar\nBeschdigung , die nicht wiederherstellbar ist oder zur permanenter Downtime fhrt','Zeer ernstig effect, ondraaglijk\nOnherstelbare aantasting die uitmondt in een definitieve onbeschikbaarheid','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1205,44,100,267,4,4,'Impact trs srieux, insupportable\nIndisponibilit demandant un trs gros effort de rtablissement, voire dfinitif.\nExemples :\n- Large dpassement des dlais maximums considrs comme insupportables','Really strong impact, unbearable.\nUnavailability which asks some drastic efforts to recover, or even final.\nExample:\n- Important maximums time periods consider as unbearable.','uerst starke Auswirkung, untragbar\nNichtverfgbarkeit, die einige drastische Anstrengungen zur Wiederherstellung erfordert oder sogar endgltig ist\nBeispiel:\n- Substanzielle Hchstdauerphasen gelten als untragbar.','Zeer ernstig effect, ondraaglijk\nOnbeschikbaarheid die een zeer grote of zelfs definitieve herstelinspanning vergt.\nVoorbeelden:\n- ruime overschrijding van de als ondraaglijk beschouwde maximumtermijnen','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1206,44,100,268,4,4,'Mort dhomme.\nAltration dfinitive de limage de lorganisme ou de ses reprsentants.\nCouverture mdiatique internationale.','Death of someone.\nDefinitive degradation of the company or staff reputation. \nInternationnal media coverage.','Tod einer Person\nDefinitive Abwertung der Firma oder des Rufs der Belegschaft \nInternationale Berichterstattung','Sterfgeval. \nDefinitieve aantasting van het imago van het organisme of van zijn vertegenwoordigers.\nInternationale mediaberichtgeving.','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1207,44,100,269,4,4,'Arrt total de tous les services.','Complete stop of all services','Vlliger Stillstand aller Dienste','Totale stopzetting van alle diensten','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1208,44,100,270,4,4,'Condamnation lourde de lorganisme.','Heavy sentence for the company.','Schwere Strafe fr die Firma','Ernstige veroordeling van het organisme.','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1209,44,100,271,4,4,'Engage de frais quasiment insurmontable. (+/- 20% CA)','Brings some deadly fees almost insurmontable (more or less 20% of the sales revenue).','Fhrt zu einigen ruinsen, fast unberwindbaren Gebhren (um 20% der Verkaufserlse).','Veroorzaakt praktisch niet te dragen kosten. (+/- 20% omzet)','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1210,44,100,272,4,4,'Consquences significatives, voire irrmdiables, qui pourraient ne pas tre surmontes (pril financier, dettes importantes, impossibilit de travailler, affection psychologique ou physique de longue dure, dcs, etc.)','Significative consequences almost irremediable, which can\'t be topped (financial distress, important financial debts, working impossibility, long periods psychological and physiological affection, death, etc.).','Erhebliche,nahezu irreparable Folgen, die nicht berwunden werden knnen (finanzielle Notlage, hohe Finanzverbindlichkeiten, Arbeitsunfhigkeit, langwierige psychologische und physiologische Erkrankung, Tod usw.)','Aanzienlijke of zelfs onomkeerbare gevolgen, die men niet te boven zou kunnen komen (financieel risico, aanzienlijke schulden, onmogelijkheid om te werken, langdurige geestelijke of lichamelijke aandoening, overlijdenenz.)','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1211,44,101,NULL,0,0,'Impossible','Impossible','Unmglich','Onmogelijk','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1212,44,101,NULL,1,1,'Trs improbable : jamais arriv, ncessite d\'un haut niveau d\'expertise, ou trs coteux  mettre en uvre.','Very unlikely: never happened, requires a high level of expert knowledge, or it is very expensive to execute.','Sehr unwahrscheinlich: nie aufgetreten, erfordert ein hohes Niveau an Fachwissen oder ist kostspielig bei der Ausfhrung','Zeer onwaarschijnlijk: nooit voorgekomen, vereist een hoog expertiseniveau, of zeer kostelijk om te implementeren.','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1213,44,101,NULL,2,2,'Improbable : Peut tre dj survenu, phnomne rare ou ncessite d\'un bon niveau d\'expertise ou coteux  mettre en uvre.','Unlikely: might have happened, rare phenomenon which requires a good level of expert knowledge, or it is expensive to execute.','Unwahrscheinlich: htte auftreten knnen, seltenes Phnomen, das ein gutes Niveau an Fachwissen erfordert oder kostspielig bei der Ausfhrung ist','Onwaarschijnlijk: kan al ooit zijn voorgekomen, zeldzaam verschijnsel of vereist een goed expertiseniveau of kostelijk om te implementeren.','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1214,44,101,NULL,3,3,'Peut arriver de temps  autre.','Could happen occasionally','Knnte gelegentlich auftreten','Kan nu en dan voorkomen','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1215,44,101,NULL,4,4,'Trs probable: facile  mettre en uvre, pas d\'investissement ou d\'expertise particulire.','Very likely: easy to execute, no mentionable investment or knowledge necessary','Sehr wahrscheinlich: einfach auszufhren, keine nennenswerte Investitionen oder Kenntnisse erforderlich','Zeer waarschijnlijk: gemakkelijk te implementeren, geen investering of specifieke expertise','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1216,44,102,NULL,0,0,'Pas de vulnrabilit.','No vulnerabilities.','Keine Sicherheitsrisiken','Geen kwetsbaarheid','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1217,44,102,NULL,1,1,'Vulnrabilit trs faible : Des mesures efficaces sont en place, leurs efficacits sont contrles.\nTrs bonne maturit : Les bonnes pratiques sont implmentes et priodiquement vrifies.','Very weak vulnerability: Some efficient measures have been already taken, and their effectiveness is controlled.\nVery high maturity: Good practices are implemented and frequently verified.','Sehr geringes Sicherheitsrisiko: Einige effiziente Manahmen wurden bereits getroffen und ihre Effizienz wird kontrolliert.\nSehr hoher Reifegrad: Bewhrte Verfahrensweisen sind implementiert und werden hufig berprft.','Zeer geringe kwetsbaarheid: er werden doeltreffende maatregelen genomen. De goede praktijken werden gemplementeerd en worden regelmatig geverifieerd.','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1218,44,102,NULL,2,2,'Vulnrabilit faible : Des mesures efficaces sont en place.\nBonne maturit : Les bonnes pratiques sont implmentes.','Weak vulnerability: Some efficient measures have been already taken.\nHigh maturity: Good practices are implemented.','Geringes Sicherheitsrisiko: Einige effiziente Manahmen wurden bereits getroffen.\nHoher Reifegrad: Bewhrte Verfahrensweisen sind implementiert.','Geringe kwetsbaarheid: er werden doeltreffende maatregelen genomen. De goede praktijken werden gemplementeerd.','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1219,44,102,NULL,3,3,'Vulnrabilit normale : Des mesures sont en place, elle peuvent encore tre amliores.\nMaturit moyenne : Les bonnes pratiques sont implmentes sans recherche d\'amlioration.','Average vulnerability: Some measures have been already taken, even though they could be better.\nAverage maturity: Good practices are implemented without searching a better way.','Durchschnittliches Sicherheitsrisiko: Einige Manahmen wurden bereits ergriffen, knnten jedoch besser sein.\nDurchschnittlicher Reifegrad: Bewhrte Verfahrensweisen sind implementiert ohne Suche nach einem besseren Weg.','Normale kwetsbaarheid: er zijn maatregelen getroffen, en die werken zonder dat er naar verbetering wordt gestreefd.','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1220,44,102,NULL,4,4,'Vulnrabilit leve : Des mesures sont en place, mais elles sont peu efficaces ou inadaptes.\nMaturit faible : Les bonnes pratiques ne sont pas implmentes, pratiques primaires sans rflexion.','Strong vulnerability: Some measures have been already taken, even though they are ineffective or unadapted.\nLow maturity: Good practices arent implemented, but there are some positive reactions without any thoughts.','Hohes Sicherheitsrisiko: Einige Manahmen wurden bereits ergriffen, sind jedoch ineffizient oder ungeeignet.\nNiedriger Reifegrad: Bewhrte Verfahrensweisen sind nicht implementiert, aber es gibt einige positive unberlegt Reaktionen.','Hoge kwetsbaarheid: er zijn maatregelen getroffen, maar die zijn niet bijzonder efficint of onaangepast.','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL),(1221,44,102,NULL,5,5,'Vulnrabilit trs leve : aucune mesure en place.\nMaturit trs faible - Aucune maturit.','Very strong vulnerability: No measures have been implemented.\nVery low maturity or no maturity at all.','Sehr hohes Sicherheitsrisiko: Manahmen wurden nicht implementiert.\nSehr niedriger Reifegrad oder vllig fehlender Reifegrad','Zeer hoge kwetsbaarheid: geen maatregelen getroffen.','ruslan.baidan@nc3.lu','2025-12-16 16:02:59',NULL,NULL);
