INSERT INTO `threats` VALUES ('b402d4e0-4576-11e9-9173-0800277f0571',37,0,'MA11','Erreur d\'utilisation','Error in use','Benutzungsfehler','Gebruiksfout','Personne commettant une erreur de manipulation, de saisie, d\'utilisation de matriels ou logiciels.','A person commits an operating error, input error or utilisation error on hardware or software.','Jemand begeht einen Bedienungs-, Eingabe- oder Benutzungsfehler (Hard- oder Software).\n','Persoon die een fout begaat bij het bedienen of gebruiken van hardware of software.',1,1,1,1,1,NULL,-1,NULL,'2017-01-19 11:47:07',NULL,NULL),('b402d513-4576-11e9-9173-0800277f0571',41,0,'MA15','Dysfonctionnement logiciel','Software malfunction','Fehlerhafter betrieb von softwareprogrammen','Slecht functionerende software','Erreur de conception, erreur d\'installation ou ngligence d\'exploitation commise lors de modification provoquant une excution non-conforme.','Design error, installation error or operating error committed during modification causing incorrect execution.','Ein Konzeptionsfehler, Installationsfehler oder eine Nachlssigkeit bei Durchfhrung einer nderung verhindern einen konformen Betrieb.\n','Ontwerpfout, installatiefout of exploitatienalatigheid begaan tijdens een wijziging en resulterend in een niet-conforme uitvoering.',0,1,1,1,1,NULL,-1,NULL,'2017-01-19 11:47:07',NULL,NULL),('b402d523-4576-11e9-9173-0800277f0571',41,0,'MA16','Dysfonctionnement ou panne du matriel','Equipment malfunction or failure','Fehlfunktion oder Ausfallen von Betriebsmittel','Slecht functionerende of defecte hardware','vnement logique ou physique provoquant des dysfonctionnements ou des pannes d\'un matriel.','Logical or physical event causing hardware malfunctions or failures.','Ein logisches oder physisches Ereignis bewirkt einen fehlerhaften Betrieb des Betriebsmittels.','Logische of fysieke gebeurtenis die een storing of een defect in bepaalde hardware veroorzaakt.',0,1,1,1,1,NULL,-1,NULL,'2017-01-19 11:47:07',NULL,NULL),('b402d530-4576-11e9-9173-0800277f0571',37,0,'MD14','Usurpation de droits','Forging of rights','Rechtsanmassung','Toe-eigening van rechten','Personne se faisant passer pour une autre de manire  utiliser ces privilges d\'accs au systme d\'information, dsinformer le destinataire, raliser une fraude','A person assumes the identity of a different person in order to use his/her access rights to the information system, misinform the recipient, commit a fraud, etc.','Jemand gibt sich als jemand anderes aus, um sich mit dessen Zugriffsprivilegien Zugang zum IT-System zu verschaffen, den Empfnger falsch zu informieren, eine betrgerische Tat auszufhren usw.\n','Persoon die zich voordoet als een ander om gebruik te maken van diens toegangsrechten tot het informatiesysteem, om de ontvanger verkeerde informatie te verstrekken, om fraude te plegen',1,1,1,1,1,NULL,-1,NULL,'2017-01-19 11:47:07',NULL,NULL),('b402d557-4576-11e9-9173-0800277f0571',37,0,'MD15','coute passive','Eavesdropping','Passives mithren','Passieve afluistering','Personne tant connecte aux quipements ou aux supports de communication ou place dans le primtre de couverture d\'mission d\'une communication.','Someone connected to communication equipment or media or located inside the transmission coverage boundaries of a communication.','Jemand zapft Kommunikationsgerte oder -trger an oder befindet sich im Sendebereich einer Kommunikation.','Persoon die is aangesloten op de uitrustingen of de communicatiedragers of die zich binnen het uitzendgebied van een communicatie bevindt.',1,0,0,1,1,NULL,-1,NULL,'2017-01-19 11:47:07',NULL,NULL),('b402d563-4576-11e9-9173-0800277f0571',39,0,'MD19','Espionnage  distance','Remote spying','Fern-spionage','Spionage op afstand','Actions dun personnel observables  distance. Observation visuelle avec ou sans moyen optique, par exemple observation dun utilisateur saisissant un code ou un mot de passe sur un clavier.','Personnel actions observable from a distance. Visual observation with or without optical equipment, for example observation of a user entering a code or password on a keyboard.','Beobachtung aus der Entfernung von Aktionen, die von Mitarbeitern ausgefhrt werden. Visuelle Beobachtung ohne optische Mittel, z. B. Beobachtung eines Nutzers, der ber Tastatur einen Code oder ein Passwort eingibt.\n','Op afstand observeerbare handelingen van personeel. Visuele observatie met of zonder optische middelen, zoals de observatie van een gebruiker die een code of een wachtwoord invoert op een toetsenbord.',1,0,0,1,1,NULL,-1,NULL,'2017-01-19 11:47:07',NULL,NULL),('b402d56f-4576-11e9-9173-0800277f0571',39,0,'MD21','Pigeage du matriel','Tampering with hardware','Sabotieren der hardware','Ondermijnen van de hardware','Personne ayant accs  un support de communication ou  un quipement pour y dposer un mcanisme d\'interception ou de destruction.','Someone with access to a communication medium or equipment installs an interception or destruction device in it.','Jemand verschafft sich Zugang zu einem Kommunikationstrger oder Gert, um dort einen Schnffel- oder Zerstrungsmechanismus zu installieren.\n','Persoon die zich toegang verschaft tot een communicatiedrager of tot een uitrusting om er onderscheppings- of vernietigingssysteem in aan te brengen.',1,1,0,1,1,NULL,-1,NULL,'2017-01-19 11:47:07',NULL,NULL),('b402d579-4576-11e9-9173-0800277f0571',38,0,'MD22','Copie frauduleuse ou utilisation de logiciels contrefaits','Fraudulent copying or use of counterfeit software','Betrgeriches Kopieren oder Nutzung von Raubkopien von Software','Frauduleus kopiren of gebruiken van nagemaakte software','Personne interne  l\'organisme faisant des copies pirates (galement appeles copies serviles) de progiciels ou de logiciels \"maison\".','Someone inside the organisation makes fraudulent copies (also called pirated copies) of package software or in-house software.','Institutionsinterne Person fertigen Piratenkopien (auch sklavische Kopien genannt) von \"hauseigenen\" Software und Programmpaketen an.\n','Tot het organisme behorende persoon maakt illegale kopien van software of softwarepakketten die eigendom zijn van het organisme.',1,0,1,1,1,NULL,-1,NULL,'2017-01-19 11:47:07',NULL,NULL),('b402d584-4576-11e9-9173-0800277f0571',38,0,'MD23','Altration des donnes','Corruption of data','Datenmanipulation','Wijziging van de gegevens','Personne accdant aux moyens de communication du systme d\'information et altrant la transmission des informations (par interception, insertion, destruction...) ou sollicitant ces accs jusqu\' trouver un accs autoris.','Someone gains access to the communication equipment of the information system and corrupts transmission of information (by intercepting, inserting, destroying, etc.) or repeatedly attempts access until successful.','Jemand verschafft sich Zugang zu den Kommunikationsmitteln des IT-Systems und manipuliert die Datenbertragung (durch Abfangen, Einschleusen, Beseitigen) oder erprobt solange die Zugnge, bis er einen autorisierten Zugang gefunden hat.\n','Persoon die zich toegang verschaft tot de communicatiemiddelen van het informatiesysteem en die de overdracht van gegevens wijzigt (door onderschepping, inlassing, vernietiging...) of een beroep doet op die toegangsmogelijkheden tot hij een geautoriseerde toegang vindt.',0,1,0,1,1,NULL,-1,NULL,'2017-01-19 11:47:07',NULL,NULL),('b402d58f-4576-11e9-9173-0800277f0571',37,0,'MD24','Reniement d\'actions','Denial of actions','Verleugnung von aktionen','Ontkenning van handelingen','Une personne ou une entit renie sa participation  un change avec un tiers ou  la ralisation d\'une opration.','A person or entity denies being involved in an exchange with a third party or carrying out an operation.','Eine Einzelperson oder eine Entitt leugnet die Teilnahme an einem Austausch mit einem Dritten oder an der Realisierung einer bestimmten Aktion.','Een persoon of een entiteit ontkent zijn of haar deelname aan een uitwisseling met derden of aan de uitvoering van een handeling.',0,1,0,1,1,NULL,-1,NULL,'2017-01-19 11:47:07',NULL,NULL),('b402d599-4576-11e9-9173-0800277f0571',38,0,'MD26','Traitement illicite des donnes','Illegal processing of data','Unzulssige verarbeitung von daten','Onrechtmatige verwerking van de gegevens','Personne effectuant un traitement dinformation non autoris par la lgislation ou un rglement.','A person carries out information processing that is forbidden by the law or a regulation.','Jemand bearbeitet Informationen auf eine Art, die durch gesetzliche Verordnung oder durch Vorschriften untersagt ist.\n','Persoon die een informatieverwerking verricht die niet is toegestaan krachtens de wet of een reglement.',1,1,0,1,1,NULL,-1,NULL,'2017-01-19 11:47:07',NULL,NULL),('b402d5a5-4576-11e9-9173-0800277f0571',39,0,'MD27','Interception de signaux parasites compromettants','Interception of compromising interference signals','Abfangen von kompromittierenden strsignalen','Onderschepping van schadelijke stoorsignalen','Signaux parasites d\'origine lectromagntique mis par les matriels (par conduction sur les cbles d\'alimentation lectrique ou les fils de masse ou par rayonnement en espace libre).\nLa capture de ces signaux dpend de la distance  l\'quipement vis ou','Interfering signals from an electromagnetic source emitted by the equipment (by conduction on the electrical power supply cables or earth wires or by radiation in free space).\nCapture of these signals depends on the distance to the targeted equipment or t','Aussendung elektromagnetischer Strsignale (durch bertragung ber elektrische Leitungen oder ber Masseleiter oder durch Strahlung im freien Raum). Der Einfang dieser Signale hngt von der Entfernung zum anvisierten Gert oder von der Mglichkeit ab, sic','Elektromagnetische stoorsignalen uitgezonden door de hardware (door geleiding op de elektrische voedingskabels of de massakabels of door straling in de vrije ruimte).\nDe ontvangst van deze signalen hangt af van de afstand van de beoogde apparatuur of de mogelijkheid om zich 