INSERT INTO `vulnerabilities` VALUES ('69fbfdd6-4591-11e9-9173-0800277f0571',0,'1','Absence de dispositif de protge cran en cas d\'inactivit','No screen saver when equipment is inactive','Fehlende Bildschirmschutzvorrichtungen bei Nichtbenutzung','Gebrek aan een schermvergrendeling in geval van inactiviteit',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:07',NULL,NULL),('69fbfe01-4591-11e9-9173-0800277f0571',0,'10','Possibilit d\'installer des correctifs, mises  jour, patches, hotfixes...','Possibility of installing correction programmes, updates, patches, hotfixes, etc.','Mglichkeit zur Installation von Korrekturmanahmen, Updates, Patches, Hotfixes usw.','Mogelijkheid voor het installeren van patches, updates, hotfixes...',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:08',NULL,NULL),('69fbfe14-4591-11e9-9173-0800277f0571',0,'1001','Le principe du moindre privilge n\'est pas appliqu','The principle of least privilege is not applied','Der Least-Privileg-Grundsatz wird nicht angewendet','Het least privilege-beginsel wordt niet toegepast','Qui a les droits d\'accs ?\nLes droits sont-ils en rapport avec les fonctions des utilisateurs ?','Who has access rights?\nDo rights correspond to users\' roles?','Wer hat Zugriffsrechte?\nSind die Rechte von den Funktionen der Benutzer abhngig?','Wie heeft toegangsrechten?\nZijn de rechten in overeenstemming met de functies van de gebruikers?',1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbfe22-4591-11e9-9173-0800277f0571',0,'1004','Prsence de protocole ne disposant pas de fonction d\'authentification','Presence of protocol that has no authentication function','Verwendung eines Protokolls ohne Authentifizierungsfunktion','Aanwezigheid van protocol zonder authenticatiefunctie',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbfe48-4591-11e9-9173-0800277f0571',0,'1005','Les interfaces sont accessibles  tous','The interfaces can be accessed by everyone','Die Schnittstellen sind allgemein zugnglich','De interfaces zijn voor iedereen toegankelijk',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbfe54-4591-11e9-9173-0800277f0571',0,'1008','Le protocole ne permet pas l\'identification sre de l\'metteur','The protocol does not allow certain identification of the sender','Das Protokoll erlaubt keine eindeutige Identifizierung des Absenders','Het protocol maakt het niet mogelijk de zender met zekerheid te identificeren',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbfe5f-4591-11e9-9173-0800277f0571',0,'101','Possibilit d\'administrer le systme  distance','Possibility of remote system administration','Mglichkeit zur Fern-Systemadministration von jeder beliebigen Arbeitsstation aus','Mogelijkheid om het systeem op afstand te beheren','Le tltravail est-il pratiqu? \nQui a la possibilit d\'administrer le systme  distance ? En interne ? En externe ?\nQuel est le moyen technique utilis ?\nAccs toujours actifs ?\nLes changes sont-ils chiffrs ?','Is teleworking practised? \nWho can administrate the system remotely? Internally? Externally?\nWhich technical means are used?\nIs access always active?\nAre exchanges encrypted?','Wird Telearbeit praktiziert? \nWer hat die Mglichkeit, das System per Fernzugriff zu verwalten? Intern? Extern?\nWelche Technik wird dafr genutzt?\nZugriff immer aktiv?\nWird der Austausch verschlsselt?','Wordt er gebruik gemaakt van telewerk? \nWie heeft de mogelijkheid om het systeem op afstand te beheren? Intern? Extern?\nWelk technisch middel wordt daarvoor gebruikt?\nToegangen altijd actief?\nZijn de uitwisselingen gecodeerd?',1,NULL,'2017-01-19 11:47:09',NULL,NULL),('69fbfe6a-4591-11e9-9173-0800277f0571',0,'1010','Le protocole ne permet pas l\'envoi d\'accus de rception','The protocol does not allow acknowledgement of receipt to be sent','Das Protokoll ermglicht nicht den Versand einer Empfangsbesttigung','Het protocol maakt de verzending van een ontvangstbewijs niet mogelijk',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbfe7a-4591-11e9-9173-0800277f0571',0,'1012','Absence de filtrage et de journalisation sur les relais de communication inter-rseaux','No filtering and logging on communication relays between networks','Fehlende Filterung und Protokollierung an den Kommunikationsrelais zwischen den einzelnen Netzen','Gebrek aan filtrering en logging over de relais voor communicatie tussen netwerken',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbfe8a-4591-11e9-9173-0800277f0571',0,'1013','Les relais n\'identifient ni les sources ni les destinations (ex.: spoofing)','The relays identify neither the sources nor the destinations (example of impact: system vulnerable to spoofing attacks)','Die Relais identifizieren weder die Quellen noch die Ziele (mgliche Auswirkungen: Anflligkeit des Systems fr Spoofing-Angriffe)','De relais identificeren noch de bronnen noch de bestemmingen (bv.: spoofing)',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbfe99-4591-11e9-9173-0800277f0571',0,'1014','Mauvais dimensionnement (ex.: trop de donnes par rapport  la bande passante maximale)','Incorrect sizing (e.g. too much data for the maximum passband)','Schlechte Dimensionierung (z. B. zu viele Daten bezogen auf die maximale Bandbreite)','Verkeerde dimensionering (bv.: te veel gegevens in verhouding tot de maximale bandbreedte)',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbfeaa-4591-11e9-9173-0800277f0571',0,'1018','Circulation en clair des changes','Circulating information in clear text','Unverschlsselter Informationsaustausch','Ongecodeerde circulatie van de uitwisselingen',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbfeba-4591-11e9-9173-0800277f0571',0,'1019','Le systme est connect  des rseaux externes','The system is connected to external networks','Anschluss des Systems an externe Netzwerk','Het systeem is aangesloten op externe netwerken',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbfed1-4591-11e9-9173-0800277f0571',0,'102','Utilisation d\'un systme d\'exploitation standard pour lequel des attaques logiques ont dj t ralises','Use of a standard operating system on which logical attacks have already been carried out','Benutzung eines Standard-Betriebssystems, auf das bereits Softwareangriffe durchgefhrt wurden','Gebruik van een standaardbesturingssysteem waarvoor er reeds logische aanvallen werden gerealiseerd',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:09',NULL,NULL),('69fbfedc-4591-11e9-9173-0800277f0571',0,'1021','Utilisation d\'une version obsolte du serveur de messagerie','Use of an obsolete version of the messaging server','Verwendung einer veralteten Version des Mailboxservers','Gebruik van een verouderde versie van de e-mailserver',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbfee8-4591-11e9-9173-0800277f0571',0,'1022','Utilisation de systme obsolte','Use of an obsolete system','Verwendung eines veralteten Systems','Gebruik van verouderd systeem',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbfef2-4591-11e9-9173-0800277f0571',0,'1023','Utilisation de systme non standard','Use of a non-standard system','Verwendung eines nicht standardmigen Systems','Gebruik van niet-standaardsysteem',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbfefc-4591-11e9-9173-0800277f0571',0,'1024','Absence de suivi des procdures d\'installation et de maintenance (cahiers de configuration et de paramtrage)','No monitoring of installation and maintenance procedures (configuration and parameter setting records)','Fehlende Nachkontrolle der Installations- und Wartungsprozeduren (Konfigurations- und Parametrierhefte)','Gebrek aan follow-up van de installatie- en onderhoudsprocedures (configuratie- en parametreringsnotities)',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbff07-4591-11e9-9173-0800277f0571',0,'1025','Absence de moyen de support interne','No internal support tool','Fehlendes internes Untersttzungsmittel','Gebrek aan intern ondersteuningsmiddel',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbff11-4591-11e9-9173-0800277f0571',0,'1026','Le dispositif utilis permet un autre usage que celui qui est prvu','The equipment can be used for purposes other than those intended','Die jeweilige Einrichtung kann fr andere Zwecke benutzt werden als ursprnglich vorgesehen','Het gebruikte systeem maakt een ander gebruik mogelijk dan het bedoelde gebruik',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbff1b-4591-11e9-9173-0800277f0571',0,'1027','Absence d\'audit ou de supervision des accs (notamment inventaire des accs avec l\'extrieur de l\'organisme et typologie des flux)','No audit or supervision of accesses (for example inventory of accesses outside the organisation and types of data flow)','Fehlende Auditierung bzw. berwachung der Zugnge (v. a. Bestandsaufnahme der Zugnge von auen in die Institution und Typologie der Personenstrme)','Gebrek aan audit van of toezicht op de toegangen (in het bijzonder inventaris van de toegangen van buiten het organisme en typologie van de stromen)',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbff25-4591-11e9-9173-0800277f0571',0,'1028','Absence de rgle d\'accs','No access rules','Fehlende Zugangsvorschriften','Gebrek aan toegangsregels',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbff3c-4591-11e9-9173-0800277f0571',0,'1029','Le dispositif est connect  des rseaux externes','The system is connected to external networks','Anschluss der Einrichtung an externe Netzwerke','Het systeem is aangesloten op externe netwerken',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbff46-4591-11e9-9173-0800277f0571',0,'103','Possibilit d\'administrer le systme  distance depuis n\'importe quel poste','Possibility of remote system administration from any station','Mglichkeit zur Fern-Systemadministration von jeder beliebigen Arbeitsstation aus','Mogelijkheid om het systeem op afstand te beheren vanaf om het even welk werkstation',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:09',NULL,NULL),('69fbff51-4591-11e9-9173-0800277f0571',0,'1030','Le dispositif est accessible par tous','The system can be accessed by everyone','Die Einrichtung ist allgemein zugnglich','Het systeem is voor iedereen toegankelijk',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbff5b-4591-11e9-9173-0800277f0571',0,'1031','Aucune vrification de l\'origine n\'est faite avant l\'installation des applicatifs','The origin of applications is not checked before installation','Fehlende Herkunftskontrolle der Anwendungsprogramme vor der Installation','Er vindt geen controle van de herkomst plaats vr het installeren van de applicaties',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbff65-4591-11e9-9173-0800277f0571',0,'1032','Le dispositif d\'accs permet le stockage de logiciels','The access system allows software storage','Die Zugangseinrichtung ermglicht die Speicherung von Software','Het toegangssysteem maakt de opslag van software mogelijk',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbff71-4591-11e9-9173-0800277f0571',0,'1033','Le dispositif d\'accs permet le tlchargement de logiciels','The access system allows software downloads','Die Zugangseinrichtung ermglicht das Herunterladen von Software','Het toegangssysteem maakt het downloaden van software mogelijk',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbff7b-4591-11e9-9173-0800277f0571',0,'1037','Absence de mesure de protection (lecture seule...)','No protection measures (read only, etc.)','Fehlende Schutzmanahmen (nur Lesemodus z. B.)','Gebrek aan beveiligingsmaatregelen (alleen tegen lezen...)',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:25',NULL,NULL),('69fbff85-4591-11e9-9173-0800277f0571',0,'1038','Absence d\'outil de supervision','No supervision tool','Fehlendes berwachungstool','Gebrek aan toezichtstool',NULL,NULL,NULL,NULL,1,NULL,'2