y simultaneous connections)','Schlechte Dimensionierung der Ressourcen (z. B. zu viele gleichzeitige Anschaltungen)','Verkeerde dimensionering van de middelen (bv.: te veel gelijktijdige verbindingen)',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:26',NULL,NULL),('69fc0401-4591-11e9-9173-0800277f0571',0,'113','Possibilit que les systmes fonctionnent avec des systmes d\'exploitation copis illicitement ou contrefaits','Possibility of the systems operating with illegally copied or counterfeit operating systems','Mglicherweise funktionieren die Systeme mit unzulssig kopierten oder geflschten Betriebssystemen','Mogelijkheid dat de systemen werken met onrechtmatig gekopieerde of nagemaakte besturingssystemen',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:09',NULL,NULL),('69fc040b-4591-11e9-9173-0800277f0571',0,'1132','Exemplaire unique de documents papier (originaux)','Single copy of paper documents (originals)','Ein einziges Exemplar in Papierform (Original)','Papieren documenten bestaan slechts in n exemplaar (originelen)','La perte des documents serait-elle irrversible ?\nEst-ce que la copie a la valeur d\'un original ?','Would document loss be irreversible?\nDoes a copy have the same value as the original?','Wren die Dokumente bei einem Verlust unwiederbringlich verloren?\nHat die Kopie denselben Wert wie ein Original?','Zou het verlies van documenten onherstelbaar zijn?\nHeeft een kopie dezelfde waarde als een origineel?',1,NULL,'2017-01-19 11:47:26',NULL,NULL),('69fc0416-4591-11e9-9173-0800277f0571',0,'116','Le systme d\'exploitation permet d\'accder  des donnes (base de donnes...)','The software allows access to data (content of hard disc, data base, etc.)','ber das Betriebssystem besteht Zugriff auf die Daten (Datenbank u. .)','Het besturingssysteem maakt toegang tot gegevens mogelijk (database...)',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:09',NULL,NULL),('69fc0421-4591-11e9-9173-0800277f0571',0,'1165','Les utilisateurs ne sont pas sensibiliss  la scurit de l\'information','Users are not made aware of information security','Die Benutzer sind nicht fr das Thema Informationssicherheit sensibilisiert.','De gebruikers worden niet gesensibiliseerd voor informatiebeveiliging','Les utilisateurs ont-ils t sensibiliss  la scurit de l\'information ?\nDes consignes unitaires ont-elles t fournies par email, consigne interne, circulaire interne ... ?','Are users made aware of information security?\nAre unit instructions provided by email, internal instructions, internal circular, etc.?','Wurden die Benutzer fr das Thema Informationssicherheit sensibilisiert?\nWurden fr jeden Bereich gesondert Anweisungen per E-Mail, interne Handlungsanweisung, internes Rundschreiben usw. mitgeteilt? ','Werden de gebruikers gesensibiliseerd voor informatiebeveiliging?\nWerden er eenduidige instructies verschaft via e-mail, interne order, interne rondzendbrief... ?',1,NULL,'2017-01-19 11:47:27',NULL,NULL),('69fc04c4-4591-11e9-9173-0800277f0571',0,'1166','La gestion des autorisations comporte des failles','Authorisation management is flawed','Das Genehmigungsmanagement weist Mngel auf.','Het beheer van de machtiging vertoont mankementen','Y a-t-il une procdure formelle ?\nQui autorise les accs ?\nLe principe de 4 yeux est-il respect ?','Is there a formal procedure?\nWho authorises access?\nIs the four-eyes principle followed?','Gibt es ein formelles Verfahren?\nWer genehmigt die Zugriffe?\nWird das Vier-Augen-Prinzip beachtet?','Bestaat er een formele procedure?\nWie machtigt de toegangen?\nWerd het 4-ogenprincipe toegepast?',1,NULL,'2017-01-19 11:47:27',NULL,NULL),('69fc04d1-4591-11e9-9173-0800277f0571',0,'1167','L\'authentification des utilisateurs n\'est pas assure','User authentication is not ensured','Die Authentifizierung der Benutzer ist nicht gewhrleistet.','Er wordt niet gezorgd voor een authenticatie van de gebruikers','Y a-t-il une politique de mots de passe ?\nBonnes pratiques (longueur, complexit, changement ...) ?\nY a-t-il un compte par personne ?\nY a-t-il des comptes partags ?','Is there a password policy?\nAre there good practices (length, complexity, change, etc.)?\nIs there one account per person?\nAre there shared accounts?','Gibt es Kennwortrichtlinien?\nBest-Practices (Lnge, Komplexitt, nderung usw.)?\nGibt es fr jede Person ein Konto?\nGibt es Konten, die von mehreren Benutzern gemeinsam genutzt werden?','Bestaat er een wachtwoordenbeleid?\nGoede praktijken (lengte, complexiteit, wijziging...) ?\nIs er een account per persoon?\nBestaan er gedeelde accounts?',1,NULL,'2017-01-19 11:47:27',NULL,NULL),('69fc04e2-4591-11e9-9173-0800277f0571',0,'1168','Le principe de besoin d\'en connatre n\'est pas respect','The need-to-know principle is not respected','Der Grundsatz, wonach nur Personen Zugang haben, die diesen bentigen, wird nicht beachtet.','Het need-to-know-beginsel wordt niet toegepast','Est-ce que toutes les autorisations sont donnes en respectant ce principe ?','Are all authorisations granted in compliance with this principle?','Werden alle Genehmigungen unter Beachtung dieses Prinzips erteilt?','Worden alle machtigingen verleend rekening houdend met dit beginsel?',1,NULL,'2017-01-19 11:47:27',NULL,NULL),('69fc04ed-4591-11e9-9173-0800277f0571',0,'1172','Pas d\'accord de services avec les  tiers (internes ou externes)','No SLAs with third parties (internal or external)','Keine Dienstleistungsvereinbarung mit (internen oder externen) Dritten','Geen serviceovereenkomst met derden (intern of extern)','Y a-t-il des accords contractuels formels avec les tiers principaux ?\nExiste-t-il des rgles d\'intervention ? Nom de personnes ? Dlais ?','Are there formal contractual agreements with the main third parties?\nAre there intervention rules? People\'s names? Timeframes?','Gibt es formelle vertragliche Vereinbarungen mit den wichtigsten Dritten?\nGibt es Vorschriften fr Einstze? Namen der Personen? Fristen?','Bestaan er formele contractuele afspraken met de voornaamste derden?\nBestaan er interventieregels? Naam van personen? Termijnen?',1,NULL,'2017-01-19 11:47:27',NULL,NULL),('69fc04f7-4591-11e9-9173-0800277f0571',0,'1173','Absence de plan de reprise','No recovery plan','Kein Disaster Recovery-Plan','Gebrek aan een herstelprogramma','Existe-t-il un plan de reprise ?\nEst-il exhaustif sur principales activits ?\nA-t-il t test ?','Is there a recovery plan?\nDoes it cover all the main activities?\nHas it been tested?','Gibt es einen Disaster Recovery-Plan?\nDeckt dieser die wichtigsten Aktivitten ab?\nWurde er getestet?','Bestaat er een herstelprogramma?\nIs het exhaustief voor de voornaamste activiteiten?\nWerd het getest?',1,NULL,'2017-01-19 11:47:27',NULL,NULL),('69fc0501-4591-11e9-9173-0800277f0571',0,'1174','Les backups ne sont pas raliss selon l\'tat de l\'art','Backups are not carried out in accordance with the state of the art','Backups werden nicht nach dem neuesten technischen Stand durchgefhrt.','De back-ups worden niet uitgevoerd volgens de regels van het vak','Existe-t-il une procdure de backup ?\nEst-elle formelle ?\nEst-elle exhaustive ?\nQuelle est la dure de rtention ?\nDes tests de restaurations sont effectus ?\nExiste-t-il une copie Offline ? Externalise ?','Is there a backup procedure?\nIs it formal?\nIs it exhaustive?\nHow long is the storage period?\nAre recovery tests performed?\nIs there an offline copy? An outsourced copy?','Gibt es ein Backup-Verfahren?\nHandelt es sich um ein formelles Verfahren?\nIst es umfassend?\nWie lange ist die Aufbewahrungsdauer?\nWerden Wiederherstellungstests durchgefhrt?\nGibt es eine Offline-Kopie? Ausgelagert?','Bestaat er een back-upprocedure?\nIs ze formeel?\nIs ze exhaustief?\nWat is de bewaringsduur?\nWorden er restore-tests uitgevoerd?\nBestaat er een offline-kopie? Een uitbestede?',1,NULL,'2017-01-19 11:47:27',NULL,NULL),('69fc050b-4591-11e9-9173-0800277f0571',0,'1176','Possibilit de tlcharger et d\'installer des programmes sans contrle','Programs can be downloaded and installed without monitoring','Programme knnen ohne Kontrolle heruntergeladen und installiert werden.','Mogelijkheid om programmas te downloaden en installeren zonder controle','Consignes d\'installation\nWhitelist\nContrle de l\'origine','Installation instructions\nWhitelist\nOrigin checks','Installationsanweisungen\nWhitelist\nHerkunftskontrolle','Installatie-instructies\nWhitelist\nHerkomstcontrole',1,NULL,'2017-01-19 11:47:27',NULL,NULL),('69fc0515-4591-11e9-9173-0800277f0571',0,'1177','Outils ou programmes non adapts  l\'utilisation ou non ergonomiques','Tools or programs are not adapted for use or are not ergonomic','Tools oder Programme nicht an Nutzungszweck angepasst oder nicht ergonomisch','Tools of programmas niet aangepast aan het gebruik of niet-ergonomisch','L\'ergonomie du logiciel pose-t-elle des problmes ?\nEst-il complexe  comprendre ou  utiliser ?\nLe temps de formation ou d\'adaptation est-il long ? \nExiste-t-il des cas d\'erreurs connus ?','Does the software\'s design cause users problems?\nIs it complicated to understand or use?\nDoes training or adaptation take a long time? \nAre there any known errors?','Gibt es Probleme mit der Software-Ergonomie?\nIst sie schwer zu verstehen oder zu benutzen?\nDauert die Einarbeitung und Anleitung lange?\nSind Fehler bekannt?','Zorgt de ergonomie van de software voor problemen?\nIs het complex om te begrijpen of te gebruiken?\nIs de opleidings- of aanpassingstijd lang? \nBestaan er gekende gevallen van fouten?',1,NULL,'2017-01-19 11:47:27',NULL,NULL),('69fc051f-4591-11e9-9173-0800277f0571',0,'1178','La gestion des mises  jour (patch) comporte des lacunes','Update management (patches) is flawed','Das Update-Management (Patches) weist Lcken auf.','Het beheer van de updates (patches) vertoont lacunes','Existe-t-il une procdure ? Formelle ?\nQuelle est la priodicit d\'application ? \nQui est le responsable ?\nDes tests sont-ils effectus ? Avant ? Aprs ?','Is there a procedure? Is it formal?\nHow frequently is it implemented? \nWho is in charge?\nAre tests performed? Before? After?','Gibt es ein Verfahren? Formell?\nWie sieht das Anwendungsintervall aus? \nWer ist verantwortlich?\nWerden Tests durchgefhrt? Vorher? Nachher?','Bestaat er een procedure? Is ze formeel?\nWat is de toepassingsperiodiciteit? \nWie is verantwoordelijk?\nWorden er tests uitgevoerd? Voor? Na?',1,NULL,'2017-01-19 11:47:27',NULL,NULL),('69fc0536-4591-11e9-9173-0800277f0571',0,'1179','Les locaux ne sont pas scuriss ou peuvent tre compromis par des lments externes','Premises are not secure or could be compromised by external elements','Die Rumlichkeiten sind nicht gesichert bzw. knnen von fremden Personen betreten werden.','De lokalen zijn niet beveiligd of kunnen in gevaar worden gebracht door externe elementen','Y a-t-il des possibilits de sinistres environnementaux (eau, crues, feu, poussires, tuyauterie, chaleur excessive...) ?\nDes portes coupe-feu sont-elles installes ?\nExiste-t-il des dtecteurs de fume ? des extincteurs en place ?','Are environmental incidents possible (water, flooding, fire, dust, pipes, excessive heat, etc.)?\nHave fire doors been put in?\nAre there smoke detectors and fire extinguishers?','Besteht die Gefahr von Umweltkatastrophen (Wasser, Hochwasser, Feuer, Staub, Leitungen, starke Wrmeentwicklung usw.)?\nGibt es Brandschutztren?\nGibt es Brandmelder? Feuerlscher?','Is er sprake van een risico van milieurampen (water, overstroming, brand, stof, leidingen, te grote hitte...) ?\nWerden er branddeuren voorzien?\nZijn er rookdetectors en/of brandblusapparaten?',1,NULL,'2017-01-19 11:47:27',NULL,NULL),('69fc0541-4591-11e9-9173-0800277f0571',0,'118','Aucune vrification du systme d\'exploitation n\'est faite avant l\'installation','The operating system is not checked before installation','Fehlende berprfung des Betriebssystems vor der Installation','Er wordt geen controle uitgevoerd van het besturingssysteem vr de installatie',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:09',NULL,NULL),('69fc054b-4591-11e9-9173-