ikationsmittels','Gebruik van een onbeveiligd communicatiemiddel','Le moyen de communication est-il chiffr ?\nLe moyen de communication est-il accessible par des tiers ?','Is the method of communication encrypted?\nCould third parties access the method of communication?','Ist das Kommunikationsmedium verschlsselt?\nIst das Kommunikationsmedium fr Dritte zugnglich?','Is het communicatiemiddel gecodeerd?\nIs het communicatiemiddel toegankelijk voor derden?',1,NULL,'2017-01-19 11:47:27',NULL,NULL),('69fc056a-4591-11e9-9173-0800277f0571',0,'1187','Le poste utilisateur est laiss sans surveillance','The user workstation is not monitored','Der Benutzerarbeitsplatz ist unbeaufsichtigt.','Het gebruikersstation wordt onbewaakt achtergelaten','Fermeture de session\nBlocage d\'cran','Ending a session\nScreen block','Abmeldung von Sitzungen\nBildschirmsperre','Sluiting sessie\nSchermvergrendeling',1,NULL,'2017-01-19 11:47:27',NULL,NULL),('69fc0574-4591-11e9-9173-0800277f0571',0,'1190','Les supports de backup ne sont pas entreposs dans un endroit adquat','Backup media are not stored in a suitable place','Die Backup-Datentrger werden nicht an einem geeigneten Ort aufbewahrt.','De back-updragers worden niet op een geschikte plaats ondergebracht','Qui a accs aux supports de backup ?\nLe besoin d\'en connatre est-il respect ?','Who has access to the backup media?\nIs the need-to-know principle respected?','Wer hat Zugang zu den Backup-Datentrgern?\nBeschrnkt auf Personen, die Zugriff haben mssen?','Wie heeft toegang tot de back-updragers?\nWordt het need-to-know-beginsel gerespecteerd?',1,NULL,'2017-01-19 11:47:27',NULL,NULL),('69fc057e-4591-11e9-9173-0800277f0571',0,'1191','La mise au rebut n\'est pas correctement assure','Disposal is not carried out properly','Die Vernichtung erfolgt nicht vorschriftsgem.','Er wordt niet op correcte wijze afgedankt','Existe-t-il une procdure formelle ?\nEst-elle respecte ?\nLa chaine de mise au rebut est-elle correcte ?','Is there a formal procedure?\nIs it followed?\nIs the disposal line correct?','Gibt es ein formelles Verfahren?\nWird dieses eingehalten?\nIst die Entsorgungskette richtig organisiert?','Bestaat er een formele procedure?\nWordt ze gerespecteerd?\nIs de afdankingsketen correct?',1,NULL,'2017-01-19 11:47:27',NULL,NULL),('69fc0589-4591-11e9-9173-0800277f0571',0,'12','Possibilit d\'existence de fonctions caches introduites en phase de conception et dveloppement','Possible existence of hidden functions introduced during the design and development phase','Mglichkeit des Vorhandenseins versteckter Funktionen, die whrend der Entwurfs- oder Entwicklungsphase eingeschleust wurden','Mogelijkheid van het bestaan van verborgen functies ingevoerd tijdens de ontwerp- en ontwikkelingsfase',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:08',NULL,NULL),('69fc059f-4591-11e9-9173-0800277f0571',0,'1210','Absence d\'une politique de durcissement des systmes','Lack of a system hardening policy','Keine Richtlinien fr das Hardening der Systeme','Gebrek aan een beleid voor het versterken van de systemen','Mots de passe ? Comptes par dfaut ? Services par dfaut ?\nExiste-t-il une procdure de durcissement ? Formelle ?','Passwords? Default accounts? Default services?\nIs there a hardening procedure? Is it formal?','Kennwrter? Standardkonten? Standarddienste?\nGibt es ein Hardening-Verfahren? Formell?','Wachtwoorden? Standaard accounts? Standaard services?\nBestaat er een versterkingsprocedure? Is ze formeel?',1,NULL,'2017-01-19 11:47:28',NULL,NULL),('69fc05aa-4591-11e9-9173-0800277f0571',0,'1212','Failles dans la gestion ou l\'utilisation dans les comptes  privilges','Flaws in the management or use of accounts with privileges','Verwaltung oder Nutzung der Konten mit besonderen Berechtigungen weisen Mngel auf.','Zwakke plekken in het beheer of het gebruik van de accounts met bepaalde bevoegdheden','Les comptes  privilges sont-ils inventoris ?\nLes mots de passe sont-ils stocks?\nSont-ils revus priodiquement ?\nLes droits sont-ils grs par profil/fonction de l\'utilisateur ?','Are the accounts with privileges listed?\nAre passwords stored?\nAre they regularly reviewed?\nAre rights managed by user profile/role?','Sind Konten mit besonderen Berechtigungen in einem Verzeichnis erfasst?\nWerden die Kennwrter gespeichert?\nWerden diese regelmig berprft?\nRichten sich die Rechte nach Profil/Funktion des Benutzers?','Worden de accounts met bepaalde bevoegdheden genventariseerd?\nWorden de wachtwoorden opgeslagen?\nWorden ze regelmatig herzien?\nWorden de rechten beheerd door het profiel/de functie van de gebruiker?',1,NULL,'2017-01-19 11:47:28',NULL,NULL),('69fc05b4-4591-11e9-9173-0800277f0571',0,'1213','Prsences de lacunes dans la gestion des changements ou la maintenance des logiciels','Problems in change management or software maintenance','Lcken im Change-Management bzw. in der Softwarewartung','Bestaan van lacunes in het beheer van de wijzigingen of het onderhoud van de software','La gestion des changements sur les logiciels ou sur le systme d\'information est elle correcte ?\nPlanification des changements ? Estimation des charges ? Tests avant mise en production ?','Is change management for software or the IT system correct?\nIs there planning for changes? \nCost estimates? \nTests before production begins?','Ist das Change-Management fr Software bzw. das Informationssystem angemessen?\nPlanung von nderungen? \nKostenschtzung? \nTests vor Wechsel in die Produktivumgebung?  ','Is het beheer van de wijzigingen aan de software of aan het informatiesysteem correct?\nPlanning van de wijzigingen? Schatting van de belastingen? Tests vr het in productie brengen?',1,NULL,'2017-01-19 11:47:28',NULL,NULL),('69fc05bf-4591-11e9-9173-0800277f0571',0,'1214','Absence de contrle priodique des autorisations daccs physique','Physical access authorisations are not checked regularly','Keine regelmige Kontrolle der Genehmigungen fr den physischen Zugang','Gebrek aan een periodieke controle van de fysieke-toegangsbevoegdheden','Les droits d\'accs physiques aux locaux sensibles sont-ils revus priodiquement ?\nUtilisateurs ? Administrateurs ?','Are physical access rights to sensitive premises regularly reviewed?\nUsers? Administrators?','Werden die Rechte fr den physischen Zugang zu sensiblen Rumlichkeiten regelmig berprft?\nBenutzer? Administratoren?','Worden de rechten i.v.m. de fysieke toegang tot de lokalen regelmatig herzien?\nGebruikers? Administrators?',1,NULL,'2017-01-19 11:47:28',NULL,NULL),('69fc05c9-4591-11e9-9173-0800277f0571',0,'1215','Absence de contrle priodique des autorisations daccs logique','Logical access authorisations are not checked regularly','Keine regelmige Kontrolle der Genehmigungen fr den elektronischen Zugang','Gebrek aan een periodieke controle van de logische-toegangsbevoegdheden','Les droits d\'accs logiques sont-ils revus priodiquement ?\nComptes utilisateurs ?\nComptes  privilges ?','Are logical access rights regularly reviewed?\nUser accounts?\nAccounts with privileges?','Werden die Rechte fr den elektronischen Zugang regelmig berprft?\nBenutzerkonten?\nKonten mit besonderen Berechtigungen?','Worden de logische-toegangsrechten regelmatig herzien?\nGebruikersaccounts?\nAccounts met voorrechten?',1,NULL,'2017-01-19 11:47:28',NULL,NULL),('69fc05d3-4591-11e9-9173-0800277f0571',0,'1216','Absence de vigilance lors d\'une intervention dun tiers (fournisseur, femme de mnage, etc.)','No supervision of third-party access (supplier, cleaner, etc.)','Keine Beaufsichtigung Dritter bei ihren Einstzen (Lieferanten, Reinigungskrfte usw.)','Gebrek aan waakzaamheid tijdens een interventie van een derde (leverancier, poetsvrouwenz.)','Est-ce que les personnes normalement non autorises sont sous surveillance lors d\'intervention exceptionnelle (internes ou externes) ?','Are normally unauthorised persons (internal or external) monitored when given special access?','Stehen (interne oder externe) Personen, die normalerweise nicht befugt sind, bei auerplanmigen Einstzen unter Aufsicht? ','Staan personen die normaal niet bevoegd zijn onder toezicht tijdens een (interne of externe) uitzonderlijke interventie?',1,NULL,'2017-01-19 11:47:28',NULL,NULL),('69fc05dd-4591-11e9-9173-0800277f0571',0,'1217','Les donnes de production sont utilises  des fins de test ou de dveloppement','Production data are used for tests or development','Die Produktivdaten werden fr Test- oder Entwicklungszwecke verwendet.','De productiegegevens worden gebruikt voor test- of ontwikkelingsdoeleinden','Les donnes de production sont elles sensibles ?\nSont-elles utilises pour les tests ? Dtruites aprs les tests ?\nLes donnes peuvent-elles tre dupliques ou copies ?','Are production data sensitive?\nAre they used for tests? Are they destroyed after the tests?\nCan data be duplicated or copied?','Handelt es sich bei den Produktivdaten um sensible Daten?\nWerden diese fr die Tests verwendet? Nach den Tests vernichtet?\nKnnen die Daten dupliziert oder kopiert werden?','Zijn de productiegegevens gevoelig?\nWorden ze gebruikt voor tests? Vernietigd na de tests?\nKunnen de gegevens worden gedupliceerd of gekopieerd?',1,NULL,'2017-01-19 11:47:28',NULL,NULL),('69fc05e7-4591-11e9-9173-0800277f0571',0,'1218','Absence d\'identification des besoins en scurit','Security requirements are not identified','Sicherheitsbedarf wurde nicht identifiziert','Gebrek aan een identificatie van de veiligheidsbehoeften','Les exigences de scurits ont elles t spcifies pour les changes externes ?\nY a-t-il des informations sensibles ?\nL\'change d\'information est-il chiffr ou non ?','Have security requirements been set for external exchanges?\nIs there sensitive information?\nIs information exchange encrypted?','Wurden Sicherheitsanforderungen fr den externen Datenaustausch festgelegt?\nSind sensible Informationen vorhanden?\nWird der Informationsaustausch verschlsselt oder nicht?','Werden de veiligheidseisen gespecificeerd voor externe uitwisselingen?\nIs er gevoelige informatie?\nIs de informatie-uitwisseling gecodeerd of niet?',1,NULL,'2017-01-19 11:47:28',NULL,NULL),('69fc05f1-4591-11e9-9173-0800277f0571',0,'1219','Absence de cloisonnement entre les environnements de dveloppements et d\'exploitation','No separation of development and operating environments','Keine Trennung zwischen Entwicklungs- und Produktivumgebungen','Gebrek aan een scheiding tussen de ontwikkelings- en de exploitatieomgevingen','Les environnements de dveloppement sont-ils spars ?\nQuelles sont les contraintes de passage d\'un  l\'autre ?\nQuelle mthodologie de dveloppement est utilise ?','Are the development environments separate?\nWhat are the constraints for moving from one to the other?\nWhich development method is used?','Sind die Entwicklungsumgebungen voneinander getrennt?\nWelche Beschrnkungen gibt es fr die bertragung von einer zur anderen?\nWelche Entwicklungsmethodik wird angewendet?','Zijn de ontwikkelingsomgevingen gescheiden?\nWat zijn de eisen om van de ene naar de andere over te gaan?\nWelke ontwikkelingsmethodologie wordt er gebruikt?',1,NULL,'2017-01-19 11:47:28',NULL,NULL),('69fc0607-4591-11e9-9173-0800277f0571',0,'122','Possibilit d\'amorcer plusieurs systmes d\'exploitation sur la mme machine (ex.: accs aux partitions NTFS via Linux)','Possibility of booting several operating systems on the same machine (e.g. access to NTFS partitions via Linux)','Mglichkeit, mehrere Betriebssysteme auf dem gleichen Rechner zu betreiben (z. B. Zugang zu NTFS-Partitionen via Linux)','Mogelijkheid om meerdere besturingssystemen te starten op dezelfde machine (bv.: toegang tot NTFS-partities via Linux)',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:09',NULL,NULL),('69fc0612-4591-11e9-9173-0800277f0571',0,'1220','Absence de protection d\'informations secrtes d\'authentification','No protection of confidential authentication information','Kein Schutz geheimer Authentifizierungsdaten','Gebrek aan een beveiliging van geheime authenticatiegegevens','Vrifier la gestion des moyens