ces par des personnes non autorises','The network makes it easy for unauthorised persons to use the resources','Das Netzwerk vereinfacht die Nutzung von Ressourcen durch Unbefugte','Het netwerk vergemakkelijkt het gebruik van de middelen door onbevoegde personen','Le rseau est-il segment ?\nLe rseau est-il chiffr ?\nEst-il possible de se connecter sur le rseau filaire par des botiers isols ?','Is the network segmented?\nIs the network encrypted?\nIs it possible to connect to the wired network through insulated casings?','Ist das Netzwerk segmentiert?\nIst das Netzwerk verschlsselt?\nKann man sich im kabelgebundenen Netzwerk ber Standalone-Boxen anmelden?','Is het netwerk gesegmenteerd?\nIs het netwerk gecodeerd?\nIs het mogelijk een verbinding te maken met het kabelnetwerk via gesoleerde dozen?',1,NULL,'2017-01-19 11:47:24',NULL,NULL),('69fc2b30-4591-11e9-9173-0800277f0571',0,'983','Possibilit d\'ajouter des drivations logicielles','Possibility of adding software derivations','Mglichkeit zum Hinzufgen von Softwareabzweigungen','Mogelijkheid om softwareaftakkingen toe te voegen',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:24',NULL,NULL),('69fc2b3b-4591-11e9-9173-0800277f0571',0,'984','Le rseau permet de modifier ou d\'agir sur les ressources du systme','The network allows the system resources to be modified or adjusted','Das Netzwerk lsst es zu, Systemressourcen zu ndern oder auf sie einzuwirken','Het netwerk maakt het mogelijk de middelen van het systeem te wijzigen of erop in te grijpen',NULL,NULL,NULL,NULL,1,NULL,'2017-01-19 11:47:24',NULL,NULL),('69fc2b45-4591-11e9-9173-0800277f0571',0,'985','Possibilit d\'ajouter des logiciels additionnels pour stocker, transmettre ou altrer (ex.: keylogger)','Additional software can be added for storing, transmitting or corrupting information (e.g. keylogger)','Mglichkeit zum Hinzufgen zustzlicher Softwarekomponenten zum Speichern, bertragen oder Manipulieren (z. B. Keyloggen)','Mogelijkheid voor het toevoegen van bijkomende s